(1215, '_transient_ur_addons_section_all_extensions', 'O:8:\"stdClass\":1:{s:8:\"products\";a:28:{i:0;O:8:\"stdClass\":7:{s:5:\"title\";s:15:\"Advanced Fields\";s:4:\"slug\";s:33:\"user-registration-advanced-fields\";s:4:\"name\";s:33:\"User Registration-Advanced Fields\";s:5:\"image\";s:51:\"extensions-json/sections/images/advanced-fields.png\";s:7:\"excerpt\";s:213:\"Advanced Fields provides you with additional advanced fields like Section Title, Custom HTML, Phone, Time Picker and WYSIWYG Fields. These fields will allow you to create more complex registration forms with ease.\";s:4:\"link\";s:174:\"https://wpeverest.com/wordpress-plugins/user-registration/advanced-fields/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=advanced-fields\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:1;O:8:\"stdClass\":7:{s:5:\"title\";s:23:\"WooCommerce Integration\";s:4:\"slug\";s:29:\"user-registration-woocommerce\";s:4:\"name\";s:31:\"User Registration - WooCommerce\";s:5:\"image\";s:49:\"extensions-json/sections/images/woo-extension.png\";s:7:\"excerpt\";s:148:\"Integrates WooCommerce plugin with your user-registration and allows you to manage user billing, shipping, orders via user registration account page\";s:4:\"link\";s:178:\"https://wpeverest.com/wordpress-plugins/user-registration/woocommerce/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=woocommerce-integration\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:2;O:8:\"stdClass\":7:{s:5:\"title\";s:20:\"Customize My Account\";s:4:\"slug\";s:38:\"user-registration-customize-my-account\";s:4:\"name\";s:38:\"User Registration customize my account\";s:5:\"image\";s:56:\"extensions-json/sections/images/customize-my-account.png\";s:7:\"excerpt\";s:211:\"User Registration Customize My Account add-on allows you to create, edit and delete additional tabs on the account page along with custom content for that tab. Also supports drag and drop sorting of account tabs\";s:4:\"link\";s:184:\"https://wpeverest.com/wordpress-plugins/user-registration/customize-my-account/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=customize-my-account\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:3;O:8:\"stdClass\":7:{s:5:\"title\";s:19:\"Content Restriction\";s:4:\"slug\";s:37:\"user-registration-content-restriction\";s:4:\"name\";s:39:\"User Registration - Content Restriction\";s:5:\"image\";s:55:\"extensions-json/sections/images/content-restriction.png\";s:7:\"excerpt\";s:152:\"Content Restriction addon allows you to restrict full or partial content from page, post to only logged in users or logged in users with specific roles.\";s:4:\"link\";s:182:\"https://wpeverest.com/wordpress-plugins/user-registration/content-restriction/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=content-restriction\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:4;O:8:\"stdClass\":7:{s:5:\"title\";s:16:\"Style Customizer\";s:4:\"slug\";s:34:\"user-registration-style-customizer\";s:4:\"name\";s:34:\"User Registration Style Customizer\";s:5:\"image\";s:52:\"extensions-json/sections/images/style-customizer.png\";s:7:\"excerpt\";s:282:\"Gone are the days when registration forms used to look dull and boring. Easily style your registration forms according to your needs by changing various design components such as Font size, Font color, background color, background image, Border, padding, margin, alignment and more.\";s:4:\"link\";s:176:\"https://wpeverest.com/wordpress-plugins/user-registration/style-customizer/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=style-customizer\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:5;O:8:\"stdClass\":7:{s:5:\"title\";s:11:\"File Upload\";s:4:\"slug\";s:29:\"user-registration-file-upload\";s:4:\"name\";s:31:\"User Registration - File Upload\";s:5:\"image\";s:40:\"extensions-json/sections/images/file.png\";s:7:\"excerpt\";s:232:\"File Upload addon for User Registration plugin allows you to create upload field in your registration form. You can use this field on your registration forms allowing your users to upload important files, documents, images and more.\";s:4:\"link\";s:166:\"https://wpeverest.com/wordpress-plugins/user-registration/file-upload/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=file-upload\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:6;O:8:\"stdClass\":7:{s:5:\"title\";s:17:\"Conditional Logic\";s:4:\"slug\";s:35:\"user-registration-conditional-logic\";s:4:\"name\";s:35:\"User Registration Conditional Logic\";s:5:\"image\";s:53:\"extensions-json/sections/images/conditional-logic.png\";s:7:\"excerpt\";s:227:\"Conditional Logic allows you to create more dynamic forms based on user input. You can now show or hide specific fields based on the users other input in the form. A field hide or show based on on multiple conditions fulfilled.\";s:4:\"link\";s:178:\"https://wpeverest.com/wordpress-plugins/user-registration/conditional-logic/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=conditional-logic\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:7;O:8:\"stdClass\":7:{s:5:\"title\";s:16:\"Field Visibility\";s:4:\"slug\";s:34:\"user-registration-field-visibility\";s:4:\"name\";s:34:\"User Registration Field Visibility\";s:5:\"image\";s:52:\"extensions-json/sections/images/field-visibility.png\";s:7:\"excerpt\";s:245:\"User Registration Field Visibility add-on allows user registration fields to be hidden in the frontend form or your account profile page as per your choice. Also, allows you to make a field read only in registration form or profile page or both.\";s:4:\"link\";s:176:\"https://wpeverest.com/wordpress-plugins/user-registration/field-visibility/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=field-visibility\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:8;O:8:\"stdClass\":7:{s:5:\"title\";s:16:\"Multi Step Forms\";s:4:\"slug\";s:28:\"user-registration-multi-part\";s:4:\"name\";s:28:\"User Registration Multi Part\";s:5:\"image\";s:46:\"extensions-json/sections/images/multi-part.png\";s:7:\"excerpt\";s:315:\"Lengthy forms are time-consuming and boring. Form fillers easily get distracted and quit halfway through these types of forms. But, there’s no need to worry! Our User Registration Multi-Part Add-on allows you to divide your registration forms into multiple parts according to your requirements without any hassle.\";s:4:\"link\";s:164:\"https://wpeverest.com/wordpress-plugins/user-registration/multi-part/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=multi-part\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:9;O:8:\"stdClass\":7:{s:5:\"title\";s:15:\"Profile Connect\";s:4:\"slug\";s:33:\"user-registration-profile-connect\";s:4:\"name\";s:33:\"User Registration Profile Connect\";s:5:\"image\";s:51:\"extensions-json/sections/images/profile-connect.png\";s:7:\"excerpt\";s:211:\"Connect your old users i.e users created via some other plugins, default WordPress registration form to user registration forms. Allows both individual as well as bulk connection of users to any particular form.\";s:4:\"link\";s:174:\"https://wpeverest.com/wordpress-plugins/user-registration/profile-connect/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=profile-connect\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:10;O:8:\"stdClass\":7:{s:5:\"title\";s:14:\"Social Connect\";s:4:\"slug\";s:32:\"user-registration-social-connect\";s:4:\"name\";s:34:\"User Registration - Social Connect\";s:5:\"image\";s:42:\"extensions-json/sections/images/social.png\";s:7:\"excerpt\";s:242:\"Signing up made easier and faster! With this addon you can make your users register to your site with social platforms like Facebook, Twitter, Google+, LinkedIn or others. Users details will be automatically pulled from their social profiles.\";s:4:\"link\";s:172:\"https://wpeverest.com/wordpress-plugins/user-registration/social-connect/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=social-connect\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:11;O:8:\"stdClass\":7:{s:5:\"title\";s:9:\"MailChimp\";s:4:\"slug\";s:27:\"user-registration-mailchimp\";s:4:\"name\";s:29:\"User Registration - Mailchimp\";s:5:\"image\";s:45:\"extensions-json/sections/images/mailchimp.png\";s:7:\"excerpt\";s:203:\"MailChimp add-on of User Registration plugin synchronizes your mailChimp account with User Registration plugin and automatically subscribes your site users to your mailchimp mailing list on registration.\";s:4:\"link\";s:162:\"https://wpeverest.com/wordpress-plugins/user-registration/mailchimp/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=mailchimp\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:12;O:8:\"stdClass\":7:{s:5:\"title\";s:15:\"Email Templates\";s:4:\"slug\";s:33:\"user-registration-email-templates\";s:4:\"name\";s:33:\"User Registration Email Templates\";s:5:\"image\";s:51:\"extensions-json/sections/images/email-templates.png\";s:7:\"excerpt\";s:179:\"Allows you to choose an email template or create a custom email template. It offers an easy-to-use customizer for you to change the look and feel of your User Registration emails.\";s:4:\"link\";s:174:\"https://wpeverest.com/wordpress-plugins/user-registration/email-templates/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=email-templates\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:13;O:8:\"stdClass\":7:{s:5:\"title\";s:12:\"Invite Codes\";s:4:\"slug\";s:30:\"user-registration-invite-codes\";s:4:\"name\";s:30:\"User Registration Invite Codes\";s:5:\"image\";s:48:\"extensions-json/sections/images/invite-codes.png\";s:7:\"excerpt\";s:198:\" Allows you to restrict the registration on your site to users with invite Codes only. You can create a single or multiple invitation code, set expiry date, usage limit per invitation code and more.\";s:4:\"link\";s:168:\"https://wpeverest.com/wordpress-plugins/user-registration/invite-codes/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=invite-codes\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:14;O:8:\"stdClass\":7:{s:5:\"title\";s:11:\"Geolocation\";s:4:\"slug\";s:29:\"user-registration-geolocation\";s:4:\"name\";s:29:\"User Registration Geolocation\";s:5:\"image\";s:47:\"extensions-json/sections/images/geolocation.png\";s:7:\"excerpt\";s:187:\"Allows you to collect geo location data from users who registered on your site. Information like Country, City, Zip Code, Latitude/Longitude and location map for the user will accessible.\";s:4:\"link\";s:166:\"https://wpeverest.com/wordpress-plugins/user-registration/geolocation/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=geolocation\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:15;O:8:\"stdClass\":7:{s:5:\"title\";s:19:\"PDF Form Submission\";s:4:\"slug\";s:37:\"user-registration-pdf-form-submission\";s:4:\"name\";s:37:\"User Registration PDF Form Submission\";s:5:\"image\";s:55:\"extensions-json/sections/images/pdf-form-submission.png\";s:7:\"excerpt\";s:217:\"PDF Form Submission addon allows to export registration form data in pdf form. PDF are great way to record, print and share with your team members. Automatically attachs the pdf to emails send to your users and admin.\";s:4:\"link\";s:182:\"https://wpeverest.com/wordpress-plugins/user-registration/pdf-form-submission/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=pdf-form-submission\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:16;O:8:\"stdClass\":7:{s:5:\"title\";s:12:\"Import Users\";s:4:\"slug\";s:30:\"user-registration-import-users\";s:4:\"name\";s:30:\"User Registration Import Users\";s:5:\"image\";s:48:\"extensions-json/sections/images/import-users.png\";s:7:\"excerpt\";s:171:\"You can easily import users on your WordPress site. Just select the form to map user details, choose a user data file in CSV format, map the fields, and import your users.\";s:4:\"link\";s:168:\"https://wpeverest.com/wordpress-plugins/user-registration/import-users/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=import-users\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:17;O:8:\"stdClass\":7:{s:5:\"title\";s:16:\"Frontend Listing\";s:4:\"slug\";s:34:\"user-registration-frontend-listing\";s:4:\"name\";s:34:\"User Registration Frontend Listing\";s:5:\"image\";s:52:\"extensions-json/sections/images/frontend-listing.png\";s:7:\"excerpt\";s:174:\"The Frontend Listing addon for User Registration allows you to list your users in frontend. Users and guests can view and check profile of all the members listed on the site.\";s:4:\"link\";s:176:\"https://wpeverest.com/wordpress-plugins/user-registration/frontend-listing/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=frontend-listing\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:18;O:8:\"stdClass\":7:{s:5:\"title\";s:14:\"PayPal Payment\";s:4:\"slug\";s:26:\"user-registration-payments\";s:4:\"name\";s:26:\"User Registration Payments\";s:5:\"image\";s:50:\"extensions-json/sections/images/payment-paypal.png\";s:7:\"excerpt\";s:174:\"Integrates PayPal into your forms for registration fee payments, donations, and more. set either predefined, user defined or hidden amount on the form as per the requirement.\";s:4:\"link\";s:166:\"https://wpeverest.com/wordpress-plugins/user-registration/payments/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=paypal-payment\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:19;O:8:\"stdClass\":7:{s:5:\"title\";s:6:\"Zapier\";s:4:\"slug\";s:24:\"user-registration-zapier\";s:4:\"name\";s:24:\"User Registration Zapier\";s:5:\"image\";s:42:\"extensions-json/sections/images/zapier.png\";s:7:\"excerpt\";s:161:\"Connect your user registration forms with Zapier with over 1500 web applications and pass information. So, you can save your time by easily automating your work.\";s:4:\"link\";s:156:\"https://wpeverest.com/wordpress-plugins/user-registration/zapier/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=zapier\";s:4:\"plan\";a:2:{i:0;s:4:\"plus\";i:1;s:12:\"professional\";}}i:20;O:8:\"stdClass\":7:{s:5:\"title\";s:25:\"Two Factor Authentication\";s:4:\"slug\";s:43:\"user-registration-two-factor-authentication\";s:4:\"name\";s:43:\"User Registration Two Factor Authentication\";s:5:\"image\";s:61:\"extensions-json/sections/images/two-factor-authentication.png\";s:7:\"excerpt\";s:163:\"Two Factor Authentication add-on, also known as 2FA, will provide OTP-based verification for the users for maintaining a secure site and preventing data breaching.\";s:4:\"link\";s:194:\"https://wpeverest.com/wordpress-plugins/user-registration/two-factor-authentication/?utm_source=addons-page&utm_medium=banner&utm_campaign=ur-upgrade-to-pro&utm_content=two-factor-authentication\";s:4:\"plan\";a:3:{i:0;s:8:\"personal\";i:1;s:4:\"plus\";i:2;s:12:\"professional\";}}i:21;O:8:\"stdClass\":7:{s:5:\"title\";s:6:\"Stripe\";s:4:\"slug\";s:24:\"user-registration-stripe\";s:4:\"name\";s:24:\"User Registration Stripe\";s:5:\"image\";s:42:\"extensions-json/se