(1341, 'wppb_admin_emailc_common_settings_header', 'Te ustawienia są także powielone na stronie \"Dostosowania Wiadomości Email\" po zapisaniu. Poprawne tagi {{reply_to}} oraz {{site_name}}', 'yes'),
(1342, 'wppb_emailc_common_settings_from_name', '{{site_name}}', 'yes'),
(1343, 'wppb_emailc_common_settings_from_reply_to_email', '{{reply_to}}', 'yes'),
(1344, 'wppb_admin_emailc_default_registration_email_subject', '[{{site_name}}] Nowy użytkownik został zarejestrowany!', 'yes'),
(1345, 'wppb_admin_emailc_default_registration_email_enabled', 'on', 'yes'),
(1346, 'wppb_admin_emailc_default_registration_email_content', '<p>New subscriber on {{site_name}}.</p>\n<p>Username:{{username}}</p>\n<p>Email:{{user_email}}</p>\n', 'yes'),
(1347, 'wppb_admin_emailc_user_password_reset_email_subject', '[{{site_name}}] Password Successfully Reset for {{username}}', 'yes'),
(1348, 'wppb_admin_emailc_user_password_reset_email_enabled', 'on', 'yes'),
(1349, 'wppb_admin_emailc_user_password_reset_email_content', '<p>{{username}} has requested a password change via the password reset feature.</p>\n', 'yes'),
(1350, 'wppb_user_emailc_default_registration_email_subject', 'A new account has been created for you on {{site_name}}', 'yes'),
(1351, 'wppb_user_emailc_default_registration_email_enabled', 'on', 'yes'),
(1352, 'wppb_user_emailc_default_registration_email_content', '<h3>Welcome to {{site_name}}!</h3>\n<p>Your username is: {{username}}</p>\n', 'yes'),
(1353, 'wppb_user_emailc_registr_w_email_confirm_email_subject', '[{{site_name}}] Aktywuj {{username}}', 'yes'),
(1354, 'wppb_user_emailc_registr_w_email_confirm_email_enabled', 'on', 'yes'),
(1355, 'wppb_user_emailc_registr_w_email_confirm_email_content', '<p>To activate your user, please click the following link:<br/>\n{{{activation_link}}}</p>\n<p>After you activate, you will receive another email with your credentials.</p>\n', 'yes'),
(1356, 'wppb_user_emailc_reset_email_subject', '[{{site_name}}] Reset hasła', 'yes'),
(1357, 'wppb_user_emailc_reset_email_enabled', 'on', 'yes'),
(1358, 'wppb_user_emailc_reset_email_content', '<p>Someone requested that the password be reset for the following account: {{site_name}}<br/>\nUsername: {{username}}</p>\n<p>If this was a mistake, just ignore this email and nothing will happen.</p>\n<p>To reset your password, visit the following address:<br/>\n{{{reset_link}}}</p>\n', 'yes'),
(1359, 'wppb_user_emailc_reset_success_email_subject', '[{{site_name}}] Hasło zostało zresetowanie.', 'yes'),
(1360, 'wppb_user_emailc_reset_success_email_enabled', 'on', 'yes'),
(1361, 'wppb_user_emailc_reset_success_email_content', '<p>You have successfully reset your password.</p>\n', 'yes'),
(1362, 'wppb_user_emailc_change_email_address_request_subject', '[{{site_name}}] Notice of Email Change Request', 'yes'),
(1363, 'wppb_user_emailc_change_email_address_request_enabled', 'on', 'yes'),
(1364, 'wppb_user_emailc_change_email_address_request_content', '<h3>Hi {{username}},</h3>\n<p>There is an email address change request on {{site_name}}.</p>\n<p>To change your email address click on: {{{user_email_change_link}}}</p>\n<p>Regards,<br>\nAll at {{site_name}}<br>\n<a href=\"{{site_url}}\">{{site_url}}</a></p>', 'yes'),
(1365, 'wppb_user_emailc_change_email_address_subject', '[{{site_name}}] Notice of Email Change', 'yes'),
(1366, 'wppb_user_emailc_change_email_address_enabled', 'on', 'yes'),
(1367, 'wppb_user_emailc_change_email_address_content', '<h3>Hi {{username}},</h3>\n<p>This notice confirms that your email was changed on {{site_name}}.</p>\n<p>If you did not change your email, please contact the Site Administrator at komputer803@gmail.com</p>\n<p>This email has been sent to {{user_email}}</p>\n<p>Regards,<br>\nAll at {{site_name}}<br>\n<a href=\"{{site_url}}\">{{site_url}}</a></p>', 'yes'),
