all-font-size\" style=\"color:#000000\"><em>Natura</em>, w potocznym znaczeniu, odnosi się do esencji niezmienionych przez człowieka; przestrzeń, powietrze, rzeka, liść. <em>Artyzm</em> stosuje się do mieszaniny jego woli z tymi samymi rzeczami, jak w domu, kanale, posągu, obrazie. Ale jego działania razem wzięte są tak nieznaczne, trochę odpryskiwania, pieczenia, łatania i mycia, że w tak wielkim wrażeniu, jakie wywiera świat na ludzkim umyśle, nie zmieniają wyniku.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"33%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33%\"><!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:image {\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://s.w.org/images/core/5.8/outside-01.jpg\" alt=\"Słońce przebijające się przez gęsty las.\" /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"33.62%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.62%\"><!-- wp:image {\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://s.w.org/images/core/5.8/outside-02.jpg\" alt=\"Turbiny wiatrowe stojące na trawiastej równinie, na tle błękitnego nieba.\" /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"67%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:67%\"><!-- wp:image {\"align\":\"right\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"alignright size-large\"><img src=\"https://s.w.org/images/core/5.8/outside-03.jpg\" alt=\"Słońce świeciło nad granią schodzącą do brzegu. W oddali po drodze jedzie samochód.\" /></figure></div>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"33%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"flex-basis:33%\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#000000\"}},\"fontSize\":\"extra-small\"} -->\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Niewątpliwie nie mamy pytań, na które nie ma odpowiedzi. Musimy ufać doskonałości stworzenia tak dalece, aby wierzyć, że jakakolwiek ciekawość porządku rzeczy, wzbudzona w naszych umysłach, porządek rzeczy może ją zaspokoić. Stan każdego człowieka jest rozwiązaniem w hieroglifie na te pytania, które on by postawił.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\";}i:19;O:8:\"stdClass\":7:{s:2:\"id\";i:2208;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:48:\"Dwie kolumny tekstu z przesuniętym nagłówkiem\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:2293:\"\n<div class=\"wp-block-group alignfull has-background is-layout-flow wp-block-group-is-layout-flow\" style=\"background-color:#f2f0e9\">\n<div style=\"height:70px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-block-columns alignwide are-vertically-aligned-center is-layout-flex wp-container-154 wp-block-columns-is-layout-flex\">\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" style=\"flex-basis:50%\">\n<p class=\"has-text-color\" style=\"color:#000000;font-size:30px;line-height:1.1\"><strong>Oceaniczna inspiracja</strong></p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" style=\"flex-basis:50%\">\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#000000;color:#000000\" />\n</div>\n</div>\n\n\n\n<div class=\"wp-block-columns alignwide is-layout-flex wp-container-158 wp-block-columns-is-layout-flex\">\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\"></div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Zawinąwszy welony wokół głów, kobiety weszły na pokład. Posuwali się teraz statecznie w dół rzeki, mijając ciemne kształty zakotwiczonych statków, a Londyn był rojem świateł z bladożółtym baldachimem opadającym nad nim. Były tam światła wielkich teatrów, światła długich ulic, światła, które wskazywały ogromne place domowego komfortu, światła, które wisiały wysoko w powietrzu.</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Żaden mrok nigdy nie osiadłby na tych lampach, tak jak nie osiadł na nich żaden mrok od setek lat. Straszne wydawało się to, że miasto powinno płonąć wiecznie w tym samym miejscu; straszne przynajmniej dla ludzi wyruszających na morskie przygody, którzy widzieli je jako otoczony kopiec, wiecznie spalony, wiecznie pokryty bliznami. Z pokładu statku wielkie miasto ukazało się jako przygarbiona i tchórzliwa postać, osowiały nędzarz. </p>\n</div>\n</div>\n\n\n\n<div style=\"height:40px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n</div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":7:{s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:49:\"Dwie kolumny tekstu z przesuniętym nagłówkiem.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:1:{i:0;s:0:\"\";}s:11:\"wpop_locale\";s:5:\"pl_PL\";s:15:\"wpop_wp_version\";s:0:\"\";s:25:\"wpop_contains_block_types\";s:77:\"core/column,core/columns,core/group,core/paragraph,core/separator,core/spacer\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keyword_slugs\";a:2:{i:0;s:4:\"core\";i:1;s:8:\"featured\";}s:15:\"pattern_content\";s:2890:\"<!-- wp:group {\"align\":\"