s:1526:\"\n<h2 class=\"wp-block-heading\" style=\"font-size:38px;line-height:1.4\"><strong>Podróż rozpoczęła się szczęśliwie, przy błękitnym niebie i spokojnym morzu.</strong></h2>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-173 wp-block-columns-is-layout-flex\">\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\">\n<p style=\"font-size:18px\">Weszli za nią na pokład. Dym i domy zniknęły, a statek znajdował się na szerokiej przestrzeni morza, bardzo świeżego i czystego, choć bladego we wczesnym świetle. Zostawili zabłocony Londyn. Bardzo cienka linia cienia zwężała się na horyzoncie, ledwie na tyle gruba, by wytrzymać ciężar Paryża, który jednak na niej spoczywał. Byli wolni od dróg, wolni od ludzi, i ta sama radość z wolności ogarnęła ich wszystkich.</p>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\">\n<p style=\"font-size:18px\">Statek płynął spokojnie przez małe fale, które uderzały w niego, a potem rozchodziły się jak musująca woda, pozostawiając po obu stronach niewielką granicę bąbelków i piany. Bezbarwne październikowe niebo było cienko zachmurzone, jakby przez smugę dymu z ogniska, a powietrze było cudownie słone i rześkie. Rzeczywiście było zbyt zimno, by stać w miejscu. Pani Ambrose objęła ramieniem swego męża, a gdy ruszyli, można było poznać po sposobie, w jaki jej pochylony policzek zwrócił się ku jego, że ma coś prywatnego do zakomunikowania.\n </p>\n</div>\n</div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":7:{s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:53:\"Dwie kolumny tekstu poprzedzone długim nagłówkiem.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:1:{i:0;s:0:\"\";}s:11:\"wpop_locale\";s:5:\"pl_PL\";s:15:\"wpop_wp_version\";s:0:\"\";s:25:\"wpop_contains_block_types\";s:52:\"core/column,core/columns,core/heading,core/paragraph\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keywor