(61, 1, '2023-05-07 18:40:25', '2023-05-07 16:40:25', '<h5 style=\"text-align: center;\">Regulamin gry Clicker</h5>\n<ol>\n 	<li>Definicje:\n<ol>\n 	<li>\"<strong>Gra</strong>\" - gra internetowa typu clicker, udostępniana przez właściciela na stronie internetowej.</li>\n 	<li>\"<strong>Gracz</strong>\" - osoba, która gra w grę.</li>\n 	<li>\"<strong>Waluta w grze</strong>\" - wirtualna waluta, wykorzystywana w grze do kupowania ulepszeń i innych przedmiotów.</li>\n 	<li>\"<strong>Przedmioty</strong>\" - wirtualne przedmioty, które można kupić w grze za walutę w grze.</li>\n</ol>\n</li>\n</ol>\n<ol start=\"2\">\n 	<li>Właściciel gry nie ponosi odpowiedzialności za jakiekolwiek szkody wyrządzone przez Gracza, wynikłe z korzystania z gry.</li>\n</ol>\n<ol start=\"3\">\n 	<li>Gra jest przeznaczona wyłącznie dla celów rozrywkowych, a Gracz nie może jej wykorzystywać w celach komercyjnych.</li>\n</ol>\n<ol start=\"4\">\n 	<li>Wszelkie prawa własności intelektualnej związane z grą, w tym prawa autorskie, należą do właściciela gry.</li>\n</ol>\n<ol start=\"5\">\n 	<li>Gracz może grać w grę bezpłatnie, ale w celu zakupu ulepszeń i innych przedmiotów w grze, musi korzystać z waluty w grze.</li>\n</ol>\n<ol start=\"6\">\n 	<li>Gracz ma obowiązek zachowywać się w grze w sposób zgodny z prawem, moralnością oraz zasadami dobrego wychowania.</li>\n</ol>\n<ol start=\"7\">\n 	<li>Gracz nie może:\n<ol>\n 	<li>korzystać z nielegalnych programów ani narzędzi, które dają mu nieuczciwą przewagę w grze;</li>\n 	<li>wykorzystywać błędów w grze w celu osiągnięcia korzyści;</li>\n 	<li>udostępniać swojego konta innym osobom;</li>\n 	<li>działać w sposób szkodliwy dla gry lub innych graczy.</li>\n</ol>\n</li>\n</ol>\n<ol start=\"8\">\n 	<li>Właściciel gry zastrzega sobie prawo do:\n<ol>\n 	<li>zmiany zasad gry w dowolnym momencie;</li>\n 	<li>wprowadzania nowych elementów do gry;</li>\n 	<li>usunięcia kont Graczy, którzy naruszają zasady gry.</li>\n</ol>\n</li>\n</ol>\n<ol start=\"9\">\n 	<li>Gracz może w każdej chwili zrezygnować z gry i usunąć swoje konto.</li>\n</ol>\n<ol start=\"10\">\n 	<li>Właściciel gry nie ponosi odpowiedzialności za utratę konta lub przedmiotów w grze, wynikającą z działań innych graczy lub awarii technicznych.</li>\n</ol>\n<ol start=\"11\">\n 	<li>Gracz jest odpowiedzialny za zachowanie poufności swojego hasła do konta w grze oraz za wszystkie działania podejmowane przez niego w grze. W przypadku utraty hasła lub podejrzenia, że ktoś uzyskał nieautoryzowany dostęp do konta Gracza, Gracz powinien niezwłocznie poinformować właściciela gry.</li>\n</ol>\n<ol start=\"12\">\n 	<li>Gracz jest zobowiązany do przestrzegania zasad fair play w grze oraz nie może wykorzystywać żadnych nieuczciwych praktyk, takich jak oszukiwanie lub udostępnianie nielegalnych programów lub narzędzi, które dają nieuczciwą przewagę nad innymi graczami.</li>\n</ol>\n<ol start=\"13\">\n 	<li>Właściciel gry zastrzega sobie prawo do tymczasowego lub stałego wykluczenia Gracza z gry w przypadku naruszenia zasad gry lub regulaminu. W przypadku takiego wykluczenia Gracz traci dostęp do swojego konta i nie ma prawa do zwrotu jakichkolwiek niewykorzystanych środków lub przedmiotów w grze.</li>\n</ol>\n<ol start=\"14\">\n 	<li>Właściciel gry nie ponosi odpowiedzialności za wszelkie problemy techniczne lub awarie serwera, które mogą wpłynąć na możliwość gry przez Gracza lub na utratę jego postępu w grze. Właściciel gry dokłada wszelkich starań, aby uniknąć takich sytuacji i rozwiązać problemy techniczne jak najszybciej.</li>\n</ol>\n<ol start=\"15\">\n 	<li>Gracz zgadza się na otrzymywanie wiadomości e-mail lub powiadomień związanych z grą, takich jak informacje o promocjach, aktualizacjach lub innych ważnych informacjach dotyczących gry.</li>\n</ol>\n<ol start=\"16\">\n 	<li>Właściciel gry zastrzega sobie prawo do zmiany cen waluty w grze lub przedmiotów w dowolnym czasie, ale zobowiązuje się do wcześniejszego poinformowania graczy o takich zmianach.</li>\n</ol>\n<ol start=\"17\">\n 	<li>Gracz zgadza się, że wszystkie przedmioty i waluta w grze pozostają własnością właściciela gry i nie mogą być sprzedawane, wymieniane ani przenoszone poza grę na jakiekolwiek zewnętrzne platformy.</li>\n</ol>\n<ol start=\"18\">\n 	<li>Właściciel gry zastrzega sobie prawo do zamknięcia gry w dowolnym momencie bez wcześniejszego powiadomienia graczy. W takim przypadku gracze nie będą mieli prawa do zwrotu żadnych niewykorzystanych środków lub przedmiotów w grze.</li>\n</ol>\n<ol start=\"19\">\n 	<li>Niniejszy regulamin stanowi pełne porozumienie między Graczem a właścicielem gry i zastępuje wszelkie wcześniejsze ustalenia lub umowy między stronami dotyczące gry.</li>\n</ol>', 'Regulamin', '', 'publish', 'closed', 'closed', '', 'regulamin', '', '', '2023-05-07 19:55:45', '2023-05-07 17:55:45', '', 0, 'http://clickergra.cba.pl/?page_id=61', 0, 'page', '', 0),
