(216, 1, '2023-06-11 16:36:18', '2023-06-11 14:36:18', '<?php\r\n// Połączenie z bazą danych\r\n$servername = \"localhost\";\r\n$username = \"bazaclicker\";\r\n$password = \"hP6pUptQcc\";\r\n$dbname = \"dedmenxd\";\r\n\r\n$conn = new mysqli($servername, $username, $password, $dbname);\r\nif ($conn->connect_error) {\r\n    die(\"Nie udało się połączyć z bazą danych: \" . $conn->connect_error);\r\n}\r\n\r\n// Zapytanie SQL\r\n$sql = \"SELECT user_nicename,clicker.stick1, clicker.stick2, clicker.stick3,clicker.stick4,clicker.stick5,clicker.stick6, sum(stick1+stick2+stick3+stick4+stick5+stick6) as total FROM `wp_clickerusers` inner join clicker on clicker.user_id=wp_clickerusers.ID group by user_nicename order by total desc\";\r\n$result = $conn->query($sql);\r\nif ($result->num_rows > 0) {\r\n    // Generowanie tabeli\r\n    echo \"<table>\";\r\n    echo \"<tr>\";\r\n    echo \"<th>Gracz</th>\";\r\n	echo \"<th>Naklejka 1</th>\";\r\n	echo \"<th>Naklejka 2</th>\";\r\n	echo \"<th>Naklejka 3</th>\";\r\n	echo \"<th>Naklejka 4</th>\";\r\n	echo \"<th>Naklejka 5</th>\";\r\n	echo \"<th>Naklejka 6</th>\";\r\n	echo \"<th>Wszystkie naklejki</th>\";\r\n    echo \"</tr>\";\r\n\r\n    // Wyświetlanie danych\r\n    while ($row = $result->fetch_assoc()) {\r\n        echo \"<tr>\";\r\n        echo \"<td>\" . $row[\"user_nicename\"] . \"</td>\";\r\n        echo \"<td>\" . $row[\"stick1\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"stick2\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"stick3\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"stick4\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"stick5\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"stick6\"] . \"</td>\";\r\n		echo \"<td>\" . $row[\"total\"] . \"</td>\";\r\n        echo \"</tr>\";\r\n    }\r\n    echo \"</table>\";\r\n} else {\r\n    echo \"Brak danych w tabeli.\";\r\n}\r\n\r\n$conn->close();\r\n?>\r\n', 'ranking', '', 'publish', 'closed', 'closed', '', 'ranking', '', '', '2023-06-11 17:28:46', '2023-06-11 15:28:46', '', 0, 'http://clickergra.cba.pl/?post_type=wpcode&#038;p=216', 0, 'wpcode', '', 0),
