(100, 1, '2023-05-08 12:23:05', '2023-05-08 10:23:05', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n    <title>Clicker Game</title>\r\n</head>\r\n<head>\r\n    \r\n</head>\r\n<body>\r\n	<p><span><?php\r\n	if ( is_user_logged_in() ) {\r\n    \r\n} else {\r\n	echo \'Zaloguj się na swoje konto aby nie stracić postępu!\';\r\n}?></span></p>\r\n	<?php\r\n	$userIDPAGE = get_current_user_id();\r\n	session_start();\r\n   	$_SESSION[\'userid\'] = $userIDPAGE;\r\n	?>\r\n    <h1>Clicker Game</h1>\r\n    <p>Points: <span id=\"points\"><?php echo $points; ?></span></p>\r\n\r\n    <p>Poziom Clickera: <span id=\"clickerLvl\"><?php echo $clickerLvl; ?></span></p>\r\n    <p>Koszt Ulepszenia Clickera: <span id=\"clickerUprCost\"><?php echo $clickerUprCost; ?></span></p>\r\n    <p>Współczynnik Kliknięć: <span id=\"clickerRate\"><?php echo $clickerRate; ?></span></p>\r\n	<p>Całkowita liczba zdobytych punktów: <span id=\"pointsalltime\"><?php echo $pointsalltime; ?></span></p>\r\n	<p>\r\n	<button id=\"clickButton\">Kliknij Mnie!</button>\r\n    <button id=\"buyclickerRate_upr\">Kup ulepszenie Clickera</button>\r\n	<button id=\"reset\">Zresetuj Postęp</button>\r\n	</p>\r\n	\r\n\r\n\r\n    <br><br>\r\n    <h2>Autoklikacz</h2>\r\n    <p>Poziom Autoklikacza: <span id=\"autoclickerLevel\"><?php echo $autoclickerLevel; ?></span></p>\r\n    <p>Koszt Autoklikacza: <span id=\"autoclickerCost\"><?php echo $autoclickerCost; ?></span> punktów</p> \r\n    <p>Wskaźnik automatycznego klikania: <span id=\"autoclickerRate\"><?php echo $autoclickerRate; ?></span> punktów</p> \r\n    <p>\r\n	<button id=\"buyAutoclickerButton\">Kup Autoklikacz</button>		\r\n	</p>\r\n    \r\n\r\n    <script>\r\n    var userId = 123; // Zastąp odpowiednim identyfikatorem użytkownika\r\n    var requestData = \'get_progress=true&user_id=\' + userId;\r\n\r\n    \r\n        // Obsługa kliknięcia przycisku\r\n    document.getElementById(\'clickButton\').addEventListener(\'click\', function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                document.getElementById(\'points\').textContent = jsonData.points;\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'click=true\');\r\n});\r\n\r\n// Obsługa zakupu autoclickera\r\ndocument.getElementById(\'buyAutoclickerButton\').addEventListener(\'click\', function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                if (jsonData.error) {\r\n                    alert(jsonData.error);\r\n                } else {\r\n                    document.getElementById(\'points\').textContent = jsonData.points;\r\n                    document.getElementById(\'autoclickerLevel\').textContent = jsonData.autoclickerLevel;\r\n                    document.getElementById(\'autoclickerCost\').textContent = jsonData.autoclickerCost;\r\n                    document.getElementById(\'autoclickerRate\').textContent = jsonData.autoclickerRate;\r\n                }\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'buy_autoclicker=true\');\r\n});\r\n\r\n// Obsługa zakupu ulepszenia clickera\r\ndocument.getElementById(\'buyclickerRate_upr\').addEventListener(\'click\', function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                if (jsonData.error) {\r\n                    alert(jsonData.error);\r\n                } else {\r\n                    document.getElementById(\'points\').textContent = jsonData.points;\r\n                    document.getElementById(\'clickerLvl\').textContent = jsonData.clickerLvl;\r\n                    document.getElementById(\'clickerUprCost\').textContent = jsonData.clickerUprCost;\r\n                }\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'buy_clicker_upr=true\');\r\n});\r\n		\r\n\r\n\r\n// Aktualizuj wynik co sekundę\r\nsetInterval(function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                document.getElementById(\'points\').textContent = jsonData.points;\r\n                document.getElementById(\'clickerLvl\').textContent = jsonData.clickerLvl;\r\n                document.getElementById(\'clickerUprCost\').textContent = jsonData.clickerUprCost;\r\n                document.getElementById(\'clickerRate\').textContent = jsonData.clickerRate;\r\n                document.getElementById(\'autoclickerLevel\').textContent = jsonData.autoclickerLevel;\r\n                document.getElementById(\'autoclickerCost\').textContent = jsonData.autoclickerCost;\r\n                document.getElementById(\'autoclickerRate\').textContent = jsonData.autoclickerRate;\r\n				document.getElementById(\'pointsalltime\').textContent = jsonData.pointsalltime;\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'get_progress=true\');\r\n}, 500);\r\n		\r\nsetInterval(function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.send(\'autoclick=true\');\r\n}, 1000);\r\n		// Obsługa resetu postępu\r\ndocument.getElementById(\'reset\').addEventListener(\'click\', function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/game.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                if (jsonData.error) {\r\n                    alert(jsonData.error);\r\n                } else {\r\n                    \r\n                }\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'reset_progress=true\');\r\n});\r\n\r\n    </script>\r\n</body>\r\n</html>\r\n\r\n', 'CLICKER HTML', '', 'publish', 'closed', 'closed', '', 'mysqliconnect', '', '', '2023-06-08 17:46:59', '2023-06-08 15:46:59', '', 0, 'http://clickergra.cba.pl/?post_type=wpcode&#038;p=100', 0, 'wpcode', '', 0),
