(149, 1, '2023-05-24 20:53:19', '2023-05-24 18:53:19', '<!-- wp:html -->\n<?php\n$hostname = \"localhost\";\n$username = \"clicker\";\n$password = \"NFyuDpA1DW\";\n$database = \"dedmenxd\";\n\n$mysqli = new mysqli($hostname, $username, $password, $database);\nif ($mysqli->connect_errno) {\n    echo \"Failed to connect to MySQL: \" . $mysqli->connect_error;\n    exit();\n}\n\n$money = $_GET[\'money\'];\n$moneyup = $_GET[\'moneyup\'];\n$msec = $_GET[\'msec\'];\n$upcost = $_GET[\'upcost\'];\n$catcost = $_GET[\'catcost\'];\n$workercost = $_GET[\'workercost\'];\n$upown = $_GET[\'upown\'];\n$catown = $_GET[\'catown\'];\n$workerown = $_GET[\'workerown\'];\n$catadd = $_GET[\'catadd\'];\n$workadd = $_GET[\'workadd\'];\n$cboost = $_GET[\'cboost\'];\n$wboost = $_GET[\'wboost\'];\n$catmax = $_GET[\'catmax\'];\n$workmax = $_GET[\'workmax\'];\n\nfunction savetodb()\n{\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;\n    $sql = \"INSERT INTO `clicker_game_score` (`money`, `moneyup`, `msec`, `upcost`, `catcost`, `workercost`, `upown`, `catown`, `workerown`, `catadd`, `workadd`, `cboost`, `wboost`, `catmax`, `workmax`, `id`) VALUES ($money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax, \'\')\";\n    if ($mysqli->query($sql) === TRUE) {\n        echo \"Postep gry zostal zapisany\";\n    } else {\n        echo \"Error: \" . $sql . \"<br>\" . $mysqli->error;\n    }\n}\n\nfunction loadfromdb()\n{\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;\n    $sql = \"SELECT * FROM `clicker_game_score`\";\n    $result = $mysqli->query($sql);\n    if ($result->num_rows > 0) {\n        while ($row = $result->fetch_assoc()) {\n            $money = $row[\"money\"];\n            $moneyup = $row[\"moneyup\"];\n            $msec = $row[\"msec\"];\n            $upcost = $row[\"upcost\"];\n            $catcost = $row[\"catcost\"];\n            $workercost = $row[\"workercost\"];\n            $upown = $row[\"upown\"];\n            $catown = $row[\"catown\"];\n            $workerown = $row[\"workerown\"];\n            $catadd = $row[\"catadd\"];\n            $workadd = $row[\"workadd\"];\n            $cboost = $row[\"cboost\"];\n            $wboost = $row[\"wboost\"];\n            $catmax = $row[\"catmax\"];\n            $workmax = $row[\"workmax\"];\n        }\n    }\n}\n\n<!DOCTYPE html>\n<html>\n<head>\n    <script>\n        money = 0;\n        moneyup = 1;\n        msec = 0;\n        upcost = 15;\n        catcost = 25;\n        workercost = 250;\n        upown = 0;\n        catown = 0;\n        workerown = 0;\n        catadd = 1;\n        workadd = 15;\n        cboost = 1;\n        wboost = 1;\n        catmax = 0;\n        workmax = 0;\n\n        // save before exiting\n        window.onbeforeunload = function() {\n            if (confirm(\"You have closed the window, would you like to save?\")) {\n                save();\n            }\n        };\n\n        function addcomma(x) {\n            return x.toString().replace(/\\B(?=(\\d{3})+(?!\\d))/g, \",\");\n        }\n\n        // updates all values\n        function reloadall() {\n            document.getElementById(\"click\").innerHTML =\n                \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n            document.getElementById(\"cat\").innerHTML =\n                catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd) + \"/sec\";\n            document.getElementById(\"worker\").innerHTML =\n                workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd) + \"/sec\";\n            document.getElementById(\"upgrade\").innerHTML =\n                addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\n        }\n\n        // overwrites save file\n        function save() {\n            var xhr = new XMLHttpRequest();\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?savetodb\", true);\n            xhr.onreadystatechange = function() {\n                if (xhr.readyState === 4 && xhr.status === 200) {\n                    console.log(xhr.responseText);\n                }\n            };\n            xhr.send();\n        }\n\n        // loads save file\n        function load() {\n            var xhr = new XMLHttpRequest();\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?loadfromdb\", true);\n            xhr.onreadystatechange = function() {\n                if (xhr.readyState === 4 && xhr.status === 200) {\n                    var response = JSON.parse(xhr.responseText);\n                    money = response.money;\n                    moneyup = response.moneyup;\n                    msec = response.msec;\n                    upcost = response.upcost;\n                    catcost = response.catcost;\n                    workercost = response.workercost;\n                    upown = response.upown;\n                    catown = response.catown;\n                    workerown = response.workerown;\n                    catadd = response.catadd;\n                    workadd = response.workadd;\n                    cboost = response.cboost;\n                    wboost = response.wboost;\n                    catmax = response.catmax;\n                    workmax = response.workmax;\n\n                    reloadall();\n                }\n            };\n            xhr.send();\n        }\n\n        // resets all values\n        function reset() {\n            if (confirm(\"Are you sure you want to reset?\")) {\n                money = 0;\n                moneyup = 1;\n                msec = 0;\n                upcost = 15;\n                catcost = 25;\n                workercost = 250;\n                catown = 0;\n                workerown = 0;\n                upown = 0;\n                catadd = 1;\n                workadd = 15;\n                reloadall();\n            }\n        }\n\n        // timer\n        setInterval(function() {\n            money += msec;\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n        }, 1000);\n\n        // what happens when button is clicked\n        function clicked() {\n            money += moneyup;\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n        }\n\n        // upgrade function\n        function upgrade(name) {\n            if (name == \"clicker cat\") {\n                if (money >= catcost && catown < 50) {\n                    if (catown <= 13) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 1;\n                    } else if (catown == 14) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown <= 23) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown == 24) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown <= 48) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown == 49) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    } else {\n                        msec += 15000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    }\n                    catown += 1;\n                    money -= catcost;\n                    catcost = catcost * 2;\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd * cboost) + \"/sec\";\n                } else if (catown == 50) {\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"worker\") {\n                if (money >= workercost && workerown < 50) {\n                    if (workerown <= 13) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 1;\n                    } else if (workerown == 14) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown <= 23) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown == 24) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown <= 48) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown == 49) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    } else {\n                        msec += 15000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    }\n                    workerown += 1;\n                    money -= workercost;\n                    workercost = workercost * 3;\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd * wboost) + \"/sec\";\n                } else if (workerown == 50) {\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"main upgrade\") {\n                if (money >= upcost && upown < 50) {\n                    upown += 1;\n                    money -= upcost;\n                    upcost = upcost * 2;\n                    moneyup = moneyup * 2;\n                    document.getElementById(\"click\").innerHTML =\n                        \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\n                } else if (upown == 50) {\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: MAX\";\n                }\n            }\n        }\n    </script>\n</head>\n</html>\n?>\n<center class=\" center\'=\" \"=\"\">\n<h1 id=\"total\">LB: 0</h1>\n<h5 id=\"click\" style=\"font-family:trebuchet MS;\">LB/click: 1 | LB/sec: 0</h5>\n<img class=\"round\" src=\"https://decostones.ie/wp-content/uploads/2015/11/click-hand.png\" width=\"150\" onclick=\"clicked()\">\n\n<button id=\"upgrade\" class=\"round\" onclick=\"upgrade(&quot;upgrade&quot;)\" style=\"font-family:courier;\">0-main upgrade: 15</button>\n\n<button id=\"cat\" class=\"round\" onclick=\"upgrade(&quot;clicker cat&quot;)\" style=\"font-family:courier;\">0-clicker cat: 25 | +1/sec</button>\n\n<button id=\"worker\" class=\"round\" onclick=\"upgrade(&quot;worker&quot;)\" style=\"font-family:courier;\">0-worker: 250 | +15/sec</button>\n\n<button class=\"settings\" onclick=\"save()\">Save</button>\n<button class=\"settings\" onclick=\"load()\">Load</button>\n<button class=\"settings\" onclick=\"reset()\">Reset</button>\n\n<a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a>\n\n</center>\n<!-- /wp:html -->', 'Game', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2023-05-24 20:53:19', '2023-05-24 18:53:19', '', 47, 'http://clickergra.cba.pl/?p=149', 0, 'revision', '', 0),
(134, 1, '2023-05-24 20:21:08', '2023-05-24 18:21:08', '<style>\n  .gallery {<br />\n    display: flex;<br />\n    flex-wrap: wrap;<br />\n  }<br />\n  .gallery img {<br />\n    width: 200px;<br />\n    height: auto;<br />\n    margin: 5px;<br />\n  }<br />\n</style>\n<p id=\"level\">Poziom konta: 0</p>\n<button id=\"losujBtn\">Losuj Znadżdżkę</button>\n<div class=\"gallery\" id=\"gallery\"></div>\n<script><br />\n  // Zdefiniuj tablicę znadżdżek o różnym poziomie rzadkości wraz ze ścieżkami do zdjęć<br />\n  const znadżdżki = [<br />\n    { nazwa: \'Znadżdżka 1\', rzadkosc: \'rzadka\', zdjecie: \'./kylar.png\' },<br />\n    { nazwa: \'Znadżdżka 2\', rzadkosc: \'powszechna\', zdjecie: \'./kei.png\' },<br />\n    { nazwa: \'Znadżdżka 3\', rzadkosc: \'rzadka\', zdjecie: \'./mynio.png\' },<br />\n    { nazwa: \'Znadżdżka 4\', rzadkosc: \'bardzo rzadka\', zdjecie: \'./goofy.png\' },<br />\n    { nazwa: \'Znadżdżka 5\', rzadkosc: \'powszechna\', zdjecie: \'./hades.png\' },<br />\n    { nazwa: \'Znadżdżka 6\', rzadkosc: \'rzadka\', zdjecie: \'./dycha.png\' }<br />\n  ];</p>\n<p>  const wylosowaneZnadżdżki = []; // Tablica przechowująca wylosowane znadżdżki przez użytkownika<br />\n  const count=0;<br />\n  const level=0;</p>\n<p>  // Funkcja losująca znadżdżkę na podstawie jej poziomu rzadkości<br />\n  function losujZnadżdżkę() {<br />\n    // Wygeneruj losowy indeks<br />\n    const</p>\n<p> losowyIndeks = Math.floor(Math.random() * znadżdżki.length);</p>\n<p>    // Zwróć wylosowaną znadżdżkę<br />\n    return znadżdżki[losowyIndeks];<br />\n  }</p>\n<p>  // Funkcja obsługująca kliknięcie przycisku \"Losuj Znadżdżkę\"<br />\n  function losujZnadżdżkęHandler() {<br />\n    const znadżdżka = losujZnadżdżkę();<br />\n    const levelElement = document.getElementById(\'level\');<br />\n    count++;<br />\n    if(count==10){<br />\n        count=0;<br />\n        level++;<br />\n        levelElement.innerHTML = \'Poziom konta \'+level;<br />\n    }</p>\n<p>    wylosowaneZnadżdżki.push(znadżdżka); // Dodaj wylosowaną znadżdżkę do tablicy wylosowanych</p>\n<p>    // Tworzenie elementu obrazka<br />\n    // const div = document.createElement(\'div\')<br />\n    const img = document.createElement(\'img\');<br />\n    img.src = znadżdżka.zdjecie;<br />\n    img.alt = znadżdżka.nazwa+\' \'+count+\' \'+level;</p>\n<p>    // div.appendChild(\'img\')</p>\n<p>    // Dodanie obrazka do galerii<br />\n    const gallery = document.getElementById(\'gallery\');<br />\n    gallery.appendChild(img);<br />\n  }</p>\n<p>  // Przypisanie funkcji obsługującej kliknięcie do przycisku<br />\n  const losujBtn = document.getElementById(\'losujBtn\');<br />\n  losujBtn.addEventListener(\'click\', losujZnadżdżkęHandler);<br />\n</script>', 'losowanie', '', 'inherit', 'closed', 'closed', '', '117-revision-v1', '', '', '2023-05-24 20:21:08', '2023-05-24 18:21:08', '', 117, 'http://clickergra.cba.pl/?p=134', 0, 'revision', '', 0),
(135, 1, '2023-05-24 20:40:38', '2023-05-24 18:40:38', '<!DOCTYPE html>\r\n<html>\r\n	<head>\r\n	<style>\r\n      .gallery {\r\n        display: flex;\r\n        flex-wrap: wrap;\r\n      }\r\n\r\n      .gallery img {\r\n        width: 200px;\r\n        height: auto;\r\n        margin: 5px;\r\n      }\r\n    </style>\r\n	</head>\r\n	<body>\r\n		<?php\r\n	$userIDPAGE = get_current_user_id();\r\n	session_start();\r\n   	$_SESSION[\'userid\'] = $userIDPAGE;\r\n	?>\r\n	<div class=\"center\">\r\n		<button id=\"losujBtn\">Losuj Naklejke za 150 puntków</button>\r\n	</div>\r\n	<p id=\"level\">Poziom: <span id=\"acclvl\"><?php echo $acclvl; ?></span></p>\r\n	<p>Postęp: <span id=\"count\"><?php echo $count; ?></span><span> / 10</span></p>	\r\n	<p>Stan konta: <span id=\"points\"><?php echo $points; ?></span></p>	\r\n	\r\n	<div class=\"gallery\" id=\"gallery\"></div>\r\n\r\n	<script>\r\n		let tmp;\r\n		\r\n      const Naklejki = [\r\n        { nazwa: \'Naklejka 1\', rzadkosc: \'rzadka\', zdjecie: \'../wp-content/uploads/gallery/kylar.png\' },\r\n        { nazwa: \'Naklejka 2\', rzadkosc: \'powszechna\', zdjecie: \'../wp-content/uploads/gallery/kei.png\' },\r\n        { nazwa: \'Naklejka 3\', rzadkosc: \'rzadka\', zdjecie: \'../wp-content/uploads/gallery/mynio.png\' },\r\n        { nazwa: \'Naklejka 4\', rzadkosc: \'bardzo rzadka\', zdjecie: \'../wp-content/uploads/gallery/goofy.png\' },\r\n        { nazwa: \'Naklejka 5\', rzadkosc: \'powszechna\', zdjecie: \'../wp-content/uploads/gallery/hades.png\' },\r\n        { nazwa: \'Naklejka 6\', rzadkosc: \'rzadka\', zdjecie: \'../wp-content/uploads/gallery/dycha.png\' }\r\n      ];\r\n\r\n      const wylosowaneNaklejki = []; // Tablica przechowująca wylosowane naklejki przez użytkownika\r\n      const levelElement = document.getElementById(\'level\');\r\n      const gallery = document.getElementById(\'gallery\');\r\n\r\n      // Funkcja losująca znadżdżkę na podstawie jej poziomu rzadkości\r\n      function losujNaklejke(num) {\r\n        // Wygeneruj losowy indeks\r\n        const losowyIndeks = num;\r\n\r\n        // Zwróć wylosowaną znadżdżkę\r\n        return [Naklejki[losowyIndeks],losowyIndeks];\r\n      }\r\n\r\n      // Funkcja obsługująca kliknięcie przycisku \"Losuj Znadżdżkę\"\r\n      function losujNaklejkeHandler(naklejka) {\r\n        const Naklejka = naklejka;\r\n\r\n        wylosowaneNaklejki.push(Naklejka); // Dodaj wylosowaną znadżdżkę do tablicy wylosowanych\r\n\r\n        // Wyczyść poprzednią zawartość galerii\r\n        gallery.innerHTML = \'\';\r\n\r\n        // Tworzenie elementu obrazka\r\n        const img = document.createElement(\'img\');\r\n        img.src = Naklejka.zdjecie;\r\n        img.alt = Naklejka.nazwa;\r\n\r\n        // Dodanie obrazka do galerii\r\n        gallery.appendChild(img);\r\n\r\n        // Dodaj wcześniej wylosowane znadżdżki do galerii\r\n//         for (let i = 0; i < wylosowaneZnadżdżki.length; i++) {\r\n//           const previousImg = document.createElement(\'img\');\r\n//           previousImg.src = wylosowaneZnadżdżki[i].zdjecie;\r\n//           previousImg.alt = wylosowaneZnadżdżki[i].nazwa;\r\n//           gallery.appendChild(previousImg);\r\n//         }\r\n      }\r\n\r\n      // Przypisanie funkcji obsługującej kliknięcie do przycisku\r\n      \r\n       const losujBtn = document.getElementById(\'losujBtn\');\r\n//        losujBtn.addEventListener(\'click\', losujNaklejkeHandler);\r\n		\r\n		   // Obsługa kliknięcia przycisku\r\n    document.getElementById(\'losujBtn\').addEventListener(\'click\', function() {	\r\n                \r\n		jQuery.ajax({\r\n            type: \"POST\",\r\n            url: \"/wp-includes/roll.php\",\r\n			dataType: \'json\',\r\n            data: {buy_sticker: true},\r\n            success: function(res){\r\n					if(res.num!= null){\r\n						let naklejkaID = losujNaklejke(res.num);\r\n					losujNaklejkeHandler(naklejkaID[0]);\r\n					}else{\r\n						window.alert(res.error);\r\n					}\r\n                    document.getElementById(\'points\').textContent = res.points;\r\n                    document.getElementById(\'acclvl\').textContent = res.acclvl;\r\n					document.getElementById(\'count\').textContent = res.count;\r\n            },\r\n            error: function (err) {\r\n               console.log(err);\r\n            }\r\n	});\r\n		});\r\nsetInterval(function() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/roll.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n				document.getElementById(\'points\').textContent = jsonData.points;\r\n				document.getElementById(\'acclvl\').textContent = jsonData.acclvl;\r\n				document.getElementById(\'count\').textContent = jsonData.count;\r\n			 } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'get_progress=true\');\r\n}, 500);\r\n    </script>\r\n	</body>\r\n</html>\r\n', 'roll', '', 'publish', 'closed', 'closed', '', 'roll', '', '', '2023-06-11 17:38:00', '2023-06-11 15:38:00', '', 0, 'http://clickergra.cba.pl/?post_type=wpcode&#038;p=135', 0, 'wpcode', '', 0),
(153, 1, '2023-05-24 21:09:25', '2023-05-24 19:09:25', 'money = 0;\r\n        moneyup = 1;\r\n        msec = 0;\r\n        upcost = 15;\r\n        catcost = 25;\r\n        workercost = 250;\r\n        upown = 0;\r\n        catown = 0;\r\n        workerown = 0;\r\n        catadd = 1;\r\n        workadd = 15;\r\n        cboost = 1;\r\n        wboost = 1;\r\n        catmax = 0;\r\n        workmax = 0;\r\n\r\n        // save before exiting\r\n        window.onbeforeunload = function() {\r\n            if (confirm(\"You have closed the window, would you like to save?\")) {\r\n                save();\r\n            }\r\n        };\r\n\r\n        function addcomma(x) {\r\n            return x.toString().replace(/\\B(?=(\\d{3})+(?!\\d))/g, \",\");\r\n        }\r\n\r\n        // updates all values\r\n        function reloadall() {\r\n            document.getElementById(\"click\").innerHTML =\r\n                \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\r\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n            document.getElementById(\"cat\").innerHTML =\r\n                catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd) + \"/sec\";\r\n            document.getElementById(\"worker\").innerHTML =\r\n                workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd) + \"/sec\";\r\n            document.getElementById(\"upgrade\").innerHTML =\r\n                addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\r\n        }\r\n\r\n        // overwrites save file\r\n        function save() {\r\n    fetch(\'http://clickergra.cba.pl/wp-content/code.php?savetodb\')\r\n        .then(response => {\r\n            if (response.ok) {\r\n                console.log(\"Save successful\");\r\n            } else {\r\n                console.error(\"Save failed\");\r\n            }\r\n        })\r\n        .catch(error => {\r\n            console.error(\"Save failed:\", error);\r\n        });\r\n}\r\n\r\n        // loads save file\r\n        function load() {\r\n            var xhr = new XMLHttpRequest();\r\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?loadfromdb\", true);\r\n            xhr.onreadystatechange = function() {\r\n                if (xhr.readyState === 4 && xhr.status === 200) {\r\n                    var response = JSON.parse(xhr.responseText);\r\n                    money = response.money;\r\n                    moneyup = response.moneyup;\r\n                    msec = response.msec;\r\n                    upcost = response.upcost;\r\n                    catcost = response.catcost;\r\n                    workercost = response.workercost;\r\n                    upown = response.upown;\r\n                    catown = response.catown;\r\n                    workerown = response.workerown;\r\n                    catadd = response.catadd;\r\n                    workadd = response.workadd;\r\n                    cboost = response.cboost;\r\n                    wboost = response.wboost;\r\n                    catmax = response.catmax;\r\n                    workmax = response.workmax;\r\n\r\n                    reloadall();\r\n                }\r\n            };\r\n            xhr.send();\r\n        }\r\n\r\n        // resets all values\r\n        function reset() {\r\n            if (confirm(\"Are you sure you want to reset?\")) {\r\n                money = 0;\r\n                moneyup = 1;\r\n                msec = 0;\r\n                upcost = 15;\r\n                catcost = 25;\r\n                workercost = 250;\r\n                catown = 0;\r\n                workerown = 0;\r\n                upown = 0;\r\n                catadd = 1;\r\n                workadd = 15;\r\n                reloadall();\r\n            }\r\n        }\r\n\r\n        // timer\r\n        setInterval(function() {\r\n            money += msec;\r\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n        }, 1000);\r\n\r\n        // what happens when button is clicked\r\n        function clicked() {\r\n            money += moneyup;\r\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n        }\r\n\r\n        // upgrade function\r\n        function upgrade(name) {\r\n            if (name == \"clicker cat\") {\r\n                if (money >= catcost && catown < 50) {\r\n                    if (catown <= 13) {\r\n                        msec += catadd;\r\n                        catadd++;\r\n                        cboost = 1;\r\n                    } else if (catown == 14) {\r\n                        msec += catadd;\r\n                        catadd++;\r\n                        cboost = 200;\r\n                    } else if (catown <= 23) {\r\n                        msec += 200 * catadd;\r\n                        catadd++;\r\n                        cboost = 200;\r\n                    } else if (catown == 24) {\r\n                        msec += 200 * catadd;\r\n                        catadd++;\r\n                        cboost = 5000;\r\n                    } else if (catown <= 48) {\r\n                        msec += 5000 * catadd;\r\n                        catadd++;\r\n                        cboost = 5000;\r\n                    } else if (catown == 49) {\r\n                        msec += 5000 * catadd;\r\n                        catadd++;\r\n                        cboost = 15000;\r\n                    } else {\r\n                        msec += 15000 * catadd;\r\n                        catadd++;\r\n                        cboost = 15000;\r\n                    }\r\n                    catown += 1;\r\n                    money -= catcost;\r\n                    catcost = catcost * 2;\r\n                    document.getElementById(\"cat\").innerHTML =\r\n                        catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd * cboost) + \"/sec\";\r\n                } else if (catown == 50) {\r\n                    document.getElementById(\"cat\").innerHTML =\r\n                        catown + \"-clicker cat: MAX | +15% click/sec\";\r\n                }\r\n            }\r\n\r\n            if (name == \"worker\") {\r\n                if (money >= workercost && workerown < 50) {\r\n                    if (workerown <= 13) {\r\n                        msec += workadd;\r\n                        workadd++;\r\n                        wboost = 1;\r\n                    } else if (workerown == 14) {\r\n                        msec += workadd;\r\n                        workadd++;\r\n                        wboost = 200;\r\n                    } else if (workerown <= 23) {\r\n                        msec += 200 * workadd;\r\n                        workadd++;\r\n                        wboost = 200;\r\n                    } else if (workerown == 24) {\r\n                        msec += 200 * workadd;\r\n                        workadd++;\r\n                        wboost = 5000;\r\n                    } else if (workerown <= 48) {\r\n                        msec += 5000 * workadd;\r\n                        workadd++;\r\n                        wboost = 5000;\r\n                    } else if (workerown == 49) {\r\n                        msec += 5000 * workadd;\r\n                        workadd++;\r\n                        wboost = 15000;\r\n                    } else {\r\n                        msec += 15000 * workadd;\r\n                        workadd++;\r\n                        wboost = 15000;\r\n                    }\r\n                    workerown += 1;\r\n                    money -= workercost;\r\n                    workercost = workercost * 3;\r\n                    document.getElementById(\"worker\").innerHTML =\r\n                        workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd * wboost) + \"/sec\";\r\n                } else if (workerown == 50) {\r\n                    document.getElementById(\"worker\").innerHTML =\r\n                        workerown + \"-worker: MAX | +15% click/sec\";\r\n                }\r\n            }\r\n\r\n            if (name == \"main upgrade\") {\r\n                if (money >= upcost && upown < 50) {\r\n                    upown += 1;\r\n                    money -= upcost;\r\n                    upcost = upcost * 2;\r\n                    moneyup = moneyup * 2;\r\n                    document.getElementById(\"click\").innerHTML =\r\n                        \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\r\n                    document.getElementById(\"upgrade\").innerHTML =\r\n                        addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\r\n                } else if (upown == 50) {\r\n                    document.getElementById(\"upgrade\").innerHTML =\r\n                        addcomma(upown) + \"-main upgrade: MAX\";\r\n                }\r\n            }\r\n        }', 'js', '', 'draft', 'closed', 'closed', '', 'untitled-snippet', '', '', '2023-05-24 21:59:36', '2023-05-24 19:59:36', '', 0, 'http://clickergra.cba.pl/?post_type=wpcode&#038;p=153', 0, 'wpcode', '', 0),
