(141, 1, '2023-05-24 20:39:39', '2023-05-24 18:39:39', '<!-- wp:html /-->\n\n<style>\n  .gallery {<br />\n    display: flex;<br />\n    flex-wrap: wrap;<br />\n  }<br />\n  .gallery img {<br />\n    width: 200px;<br />\n    height: auto;<br />\n    margin: 5px;<br />\n  }<br />\n</style>\n<p id=\"level\">Poziom konta: 0</p>\n<p><button id=\"losujBtn\">Losuj Znadżdżkę</button></p>\n<div class=\"gallery\" id=\"gallery\"></div>\n<p><script><br />\n  // Zdefiniuj tablicę znadżdżek o różnym poziomie rzadkości wraz ze ścieżkami do zdjęć<br />\n  const znadżdżki = [<br />\n    { nazwa: \'Znadżdżka 1\', rzadkosc: \'rzadka\', zdjecie: \'./kylar.png\' },<br />\n    { nazwa: \'Znadżdżka 2\', rzadkosc: \'powszechna\', zdjecie: \'./kei.png\' },<br />\n    { nazwa: \'Znadżdżka 3\', rzadkosc: \'rzadka\', zdjecie: \'./mynio.png\' },<br />\n    { nazwa: \'Znadżdżka 4\', rzadkosc: \'bardzo rzadka\', zdjecie: \'./goofy.png\' },<br />\n    { nazwa: \'Znadżdżka 5\', rzadkosc: \'powszechna\', zdjecie: \'./hades.png\' },<br />\n    { nazwa: \'Znadżdżka 6\', rzadkosc: \'rzadka\', zdjecie: \'./dycha.png\' }<br />\n  ];</p>\n<p>  const wylosowaneZnadżdżki = []; // Tablica przechowująca wylosowane znadżdżki przez użytkownika<br />\n  const count=0;<br />\n  const level=0;</p>\n<p>  // Funkcja losująca znadżdżkę na podstawie jej poziomu rzadkości<br />\n  function losujZnadżdżkę() {<br />\n    // Wygeneruj losowy indeks<br />\n    const</p>\n<p> losowyIndeks = Math.floor(Math.random() * znadżdżki.length);</p>\n<p>    // Zwróć wylosowaną znadżdżkę<br />\n    return znadżdżki[losowyIndeks];<br />\n  }</p>\n<p>  // Funkcja obsługująca kliknięcie przycisku \"Losuj Znadżdżkę\"<br />\n  function losujZnadżdżkęHandler() {<br />\n    const znadżdżka = losujZnadżdżkę();<br />\n    const levelElement = document.getElementById(\'level\');<br />\n    count++;<br />\n    if(count==10){<br />\n        count=0;<br />\n        level++;<br />\n        levelElement.innerHTML = \'Poziom konta \'+level;<br />\n    }</p>\n<p>    wylosowaneZnadżdżki.push(znadżdżka); // Dodaj wylosowaną znadżdżkę do tablicy wylosowanych</p>\n<p>    // Tworzenie elementu obrazka<br />\n    // const div = document.createElement(\'div\')<br />\n    const img = document.createElement(\'img\');<br />\n    img.src = znadżdżka.zdjecie;<br />\n    img.alt = znadżdżka.nazwa+\' \'+count+\' \'+level;</p>\n<p>    // div.appendChild(\'img\')</p>\n<p>    // Dodanie obrazka do galerii<br />\n    const gallery = document.getElementById(\'gallery\');<br />\n    gallery.appendChild(img);<br />\n  }</p>\n<p>  // Przypisanie funkcji obsługującej kliknięcie do przycisku<br />\n  const losujBtn = document.getElementById(\'losujBtn\');<br />\n  losujBtn.addEventListener(\'click\', losujZnadżdżkęHandler);<br />\n</script></p>\n<p><!-- /wp:html --></p>', 'losowanie', '', 'inherit', 'closed', 'closed', '', '117-revision-v1', '', '', '2023-05-24 20:39:39', '2023-05-24 18:39:39', '', 117, 'http://clickergra.cba.pl/?p=141', 0, 'revision', '', 0),
(151, 1, '2023-05-24 20:54:48', '2023-05-24 18:54:48', '<!-- wp:html -->\n<?php  echo(\"Hello, World!\"); ?>\n\n<center class=\" center\'=\" \"=\"\">\n<h1 id=\"total\">LB: 0</h1>\n<h5 id=\"click\" style=\"font-family:trebuchet MS;\">LB/click: 1 | LB/sec: 0</h5>\n<img class=\"round\" src=\"https://decostones.ie/wp-content/uploads/2015/11/click-hand.png\" width=\"150\" onclick=\"clicked()\">\n\n<button id=\"upgrade\" class=\"round\" onclick=\"upgrade(&quot;upgrade&quot;)\" style=\"font-family:courier;\">0-main upgrade: 15</button>\n\n<button id=\"cat\" class=\"round\" onclick=\"upgrade(&quot;clicker cat&quot;)\" style=\"font-family:courier;\">0-clicker cat: 25 | +1/sec</button>\n\n<button id=\"worker\" class=\"round\" onclick=\"upgrade(&quot;worker&quot;)\" style=\"font-family:courier;\">0-worker: 250 | +15/sec</button>\n\n<button class=\"settings\" onclick=\"save()\">Save</button>\n<button class=\"settings\" onclick=\"load()\">Load</button>\n<button class=\"settings\" onclick=\"reset()\">Reset</button>\n\n<a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a>\n\n</center>\n<!-- /wp:html -->', 'Game', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2023-05-24 20:54:48', '2023-05-24 18:54:48', '', 47, 'http://clickergra.cba.pl/?p=151', 0, 'revision', '', 0),
(148, 1, '2023-05-24 20:52:49', '2023-05-24 18:52:49', '<!-- wp:html -->\n<?php\n$hostname = \"localhost\";\n$username = \"clicker\";\n$password = \"NFyuDpA1DW\";\n$database = \"dedmenxd\";\n\n$mysqli = new mysqli($hostname, $username, $password, $database);\nif ($mysqli->connect_errno) {\n    echo \"Failed to connect to MySQL: \" . $mysqli->connect_error;\n    exit();\n}\n\n$money = $_GET[\'money\'];\n$moneyup = $_GET[\'moneyup\'];\n$msec = $_GET[\'msec\'];\n$upcost = $_GET[\'upcost\'];\n$catcost = $_GET[\'catcost\'];\n$workercost = $_GET[\'workercost\'];\n$upown = $_GET[\'upown\'];\n$catown = $_GET[\'catown\'];\n$workerown = $_GET[\'workerown\'];\n$catadd = $_GET[\'catadd\'];\n$workadd = $_GET[\'workadd\'];\n$cboost = $_GET[\'cboost\'];\n$wboost = $_GET[\'wboost\'];\n$catmax = $_GET[\'catmax\'];\n$workmax = $_GET[\'workmax\'];\n\nfunction savetodb()\n{\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;\n    $sql = \"INSERT INTO `clicker_game_score` (`money`, `moneyup`, `msec`, `upcost`, `catcost`, `workercost`, `upown`, `catown`, `workerown`, `catadd`, `workadd`, `cboost`, `wboost`, `catmax`, `workmax`, `id`) VALUES ($money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax, \'\')\";\n    if ($mysqli->query($sql) === TRUE) {\n        echo \"Postep gry zostal zapisany\";\n    } else {\n        echo \"Error: \" . $sql . \"<br>\" . $mysqli->error;\n    }\n}\n\nfunction loadfromdb()\n{\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;\n    $sql = \"SELECT * FROM `clicker_game_score`\";\n    $result = $mysqli->query($sql);\n    if ($result->num_rows > 0) {\n        while ($row = $result->fetch_assoc()) {\n            $money = $row[\"money\"];\n            $moneyup = $row[\"moneyup\"];\n            $msec = $row[\"msec\"];\n            $upcost = $row[\"upcost\"];\n            $catcost = $row[\"catcost\"];\n            $workercost = $row[\"workercost\"];\n            $upown = $row[\"upown\"];\n            $catown = $row[\"catown\"];\n            $workerown = $row[\"workerown\"];\n            $catadd = $row[\"catadd\"];\n            $workadd = $row[\"workadd\"];\n            $cboost = $row[\"cboost\"];\n            $wboost = $row[\"wboost\"];\n            $catmax = $row[\"catmax\"];\n            $workmax = $row[\"workmax\"];\n        }\n    }\n}\n?>\n\n<!DOCTYPE html>\n<html>\n<head>\n    <script>\n        money = 0;\n        moneyup = 1;\n        msec = 0;\n        upcost = 15;\n        catcost = 25;\n        workercost = 250;\n        upown = 0;\n        catown = 0;\n        workerown = 0;\n        catadd = 1;\n        workadd = 15;\n        cboost = 1;\n        wboost = 1;\n        catmax = 0;\n        workmax = 0;\n\n        // save before exiting\n        window.onbeforeunload = function() {\n            if (confirm(\"You have closed the window, would you like to save?\")) {\n                save();\n            }\n        };\n\n        function addcomma(x) {\n            return x.toString().replace(/\\B(?=(\\d{3})+(?!\\d))/g, \",\");\n        }\n\n        // updates all values\n        function reloadall() {\n            document.getElementById(\"click\").innerHTML =\n                \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n            document.getElementById(\"cat\").innerHTML =\n                catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd) + \"/sec\";\n            document.getElementById(\"worker\").innerHTML =\n                workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd) + \"/sec\";\n            document.getElementById(\"upgrade\").innerHTML =\n                addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\n        }\n\n        // overwrites save file\n        function save() {\n            var xhr = new XMLHttpRequest();\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?savetodb\", true);\n            xhr.onreadystatechange = function() {\n                if (xhr.readyState === 4 && xhr.status === 200) {\n                    console.log(xhr.responseText);\n                }\n            };\n            xhr.send();\n        }\n\n        // loads save file\n        function load() {\n            var xhr = new XMLHttpRequest();\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?loadfromdb\", true);\n            xhr.onreadystatechange = function() {\n                if (xhr.readyState === 4 && xhr.status === 200) {\n                    var response = JSON.parse(xhr.responseText);\n                    money = response.money;\n                    moneyup = response.moneyup;\n                    msec = response.msec;\n                    upcost = response.upcost;\n                    catcost = response.catcost;\n                    workercost = response.workercost;\n                    upown = response.upown;\n                    catown = response.catown;\n                    workerown = response.workerown;\n                    catadd = response.catadd;\n                    workadd = response.workadd;\n                    cboost = response.cboost;\n                    wboost = response.wboost;\n                    catmax = response.catmax;\n                    workmax = response.workmax;\n\n                    reloadall();\n                }\n            };\n            xhr.send();\n        }\n\n        // resets all values\n        function reset() {\n            if (confirm(\"Are you sure you want to reset?\")) {\n                money = 0;\n                moneyup = 1;\n                msec = 0;\n                upcost = 15;\n                catcost = 25;\n                workercost = 250;\n                catown = 0;\n                workerown = 0;\n                upown = 0;\n                catadd = 1;\n                workadd = 15;\n                reloadall();\n            }\n        }\n\n        // timer\n        setInterval(function() {\n            money += msec;\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n        }, 1000);\n\n        // what happens when button is clicked\n        function clicked() {\n            money += moneyup;\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\n        }\n\n        // upgrade function\n        function upgrade(name) {\n            if (name == \"clicker cat\") {\n                if (money >= catcost && catown < 50) {\n                    if (catown <= 13) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 1;\n                    } else if (catown == 14) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown <= 23) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown == 24) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown <= 48) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown == 49) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    } else {\n                        msec += 15000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    }\n                    catown += 1;\n                    money -= catcost;\n                    catcost = catcost * 2;\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd * cboost) + \"/sec\";\n                } else if (catown == 50) {\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"worker\") {\n                if (money >= workercost && workerown < 50) {\n                    if (workerown <= 13) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 1;\n                    } else if (workerown == 14) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown <= 23) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown == 24) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown <= 48) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown == 49) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    } else {\n                        msec += 15000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    }\n                    workerown += 1;\n                    money -= workercost;\n                    workercost = workercost * 3;\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd * wboost) + \"/sec\";\n                } else if (workerown == 50) {\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"main upgrade\") {\n                if (money >= upcost && upown < 50) {\n                    upown += 1;\n                    money -= upcost;\n                    upcost = upcost * 2;\n                    moneyup = moneyup * 2;\n                    document.getElementById(\"click\").innerHTML =\n                        \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\n                } else if (upown == 50) {\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: MAX\";\n                }\n            }\n        }\n    </script>\n</head>\n</html>\n?>\n<center class=\" center\'=\" \"=\"\">\n<h1 id=\"total\">LB: 0</h1>\n<h5 id=\"click\" style=\"font-family:trebuchet MS;\">LB/click: 1 | LB/sec: 0</h5>\n<img class=\"round\" src=\"https://decostones.ie/wp-content/uploads/2015/11/click-hand.png\" width=\"150\" onclick=\"clicked()\">\n\n<button id=\"upgrade\" class=\"round\" onclick=\"upgrade(&quot;upgrade&quot;)\" style=\"font-family:courier;\">0-main upgrade: 15</button>\n\n<button id=\"cat\" class=\"round\" onclick=\"upgrade(&quot;clicker cat&quot;)\" style=\"font-family:courier;\">0-clicker cat: 25 | +1/sec</button>\n\n<button id=\"worker\" class=\"round\" onclick=\"upgrade(&quot;worker&quot;)\" style=\"font-family:courier;\">0-worker: 250 | +15/sec</button>\n\n<button class=\"settings\" onclick=\"save()\">Save</button>\n<button class=\"settings\" onclick=\"load()\">Load</button>\n<button class=\"settings\" onclick=\"reset()\">Reset</button>\n\n<a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a><a href=\"http://leemlam.github.io%27%3Eclicker/ Clicker</a></div>\n<center class=\" center\'=\"\"></a>\n\n</center>\n<!-- /wp:html -->', 'Game', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2023-05-24 20:52:49', '2023-05-24 18:52:49', '', 47, 'http://clickergra.cba.pl/?p=148', 0, 'revision', '', 0),
