(213, 1, '2023-06-08 21:01:23', '2023-06-08 19:01:23', '<!DOCTYPE html>\r\n<head>\r\n\r\n<style>\r\n      .gallery {\r\n        display: inline-block;\r\n        flex-wrap: wrap;\r\n      }\r\n\r\n      .gallery img {\r\n        width: 200px;\r\n        height: auto;\r\n        margin: 5px;\r\n      }\r\n	.gallery p{\r\n		text-align: center;\r\n	}\r\n</style>\r\n</head>\r\n<body>\r\n	<?php\r\n	$userIDPAGE = get_current_user_id();\r\n	session_start();\r\n   	$_SESSION[\'userid\'] = $userIDPAGE;\r\n	?>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/kylar.png\' alt=\'kylarek\'>\r\n		<p id=\'stick1\'></p>\r\n	</div>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/kei.png\' alt=\'kei\'>\r\n		<p id=\'stick2\'></p>\r\n	</div>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/mynio.png\' alt=\'kei\'>\r\n		<p id=\'stick3\'></p>\r\n	</div>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/goofy.png\' alt=\'kei\'>\r\n		<p id=\'stick4\'></p>\r\n	</div>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/dycha.png\' alt=\'kei\'>\r\n		<p id=\'stick5\'></p>\r\n	</div>\r\n	<div class=\'gallery\'>\r\n		<img src=\'../wp-content/uploads/gallery/hades.png\' alt=\'kei\'>\r\n		<p id=\'stick6\'></p>\r\n	</div>\r\n	<script>\r\n	 window.addEventListener(\"load\", (event) => {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\'POST\', \'/wp-includes/gallery.php\', true);\r\n    xhr.setRequestHeader(\'Content-Type\', \'application/x-www-form-urlencoded\');\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = xhr.responseText;\r\n            console.log(\'Server response:\', response); // Wyświetlenie odpowiedzi serwera w konsoli\r\n            try {\r\n                var jsonData = JSON.parse(response);\r\n                if (jsonData.error) {\r\n                    alert(jsonData.error);\r\n					\r\n                } else {\r\n                    document.getElementById(\'stick1\').textContent = jsonData.stick1;\r\n					document.getElementById(\'stick2\').textContent = jsonData.stick2;\r\n					document.getElementById(\'stick3\').textContent = jsonData.stick3;\r\n					document.getElementById(\'stick4\').textContent = jsonData.stick4;\r\n					document.getElementById(\'stick5\').textContent = jsonData.stick5;\r\n					document.getElementById(\'stick6\').textContent = jsonData.stick6;\r\n                }\r\n            } catch (error) {\r\n                console.error(\'Error parsing JSON response:\', error);\r\n            }\r\n        }\r\n    };\r\n    xhr.send(\'load_gallery\');\r\n});\r\n	</script>\r\n</body>\r\n	', 'Gallery', '', 'publish', 'closed', 'closed', '', 'gallery', '', '', '2023-06-08 21:45:48', '2023-06-08 19:45:48', '', 0, 'http://clickergra.cba.pl/?post_type=wpcode&#038;p=213', 0, 'wpcode', '', 0),
