(146, 1, '2023-05-24 20:48:27', '2023-05-24 18:48:27', '<p><!--?php\n$hostname = \"localhost\";\n$username = \"clicker\";\n$password = \"NFyuDpA1DW\";\n$database = \"dedmenxd\";\n\n$mysqli = new mysqli($hostname, $username, $password, $database);\nif ($mysqli--->connect_errno) {<br>\n    echo \"Failed to connect to MySQL: \" . $mysqli-&gt;connect_error;<br>\n    exit();<br>\n}</p>\n<p>$money = $_GET[\'money\'];<br>\n$moneyup = $_GET[\'moneyup\'];<br>\n$msec = $_GET[\'msec\'];<br>\n$upcost = $_GET[\'upcost\'];<br>\n$catcost = $_GET[\'catcost\'];<br>\n$workercost = $_GET[\'workercost\'];<br>\n$upown = $_GET[\'upown\'];<br>\n$catown = $_GET[\'catown\'];<br>\n$workerown = $_GET[\'workerown\'];<br>\n$catadd = $_GET[\'catadd\'];<br>\n$workadd = $_GET[\'workadd\'];<br>\n$cboost = $_GET[\'cboost\'];<br>\n$wboost = $_GET[\'wboost\'];<br>\n$catmax = $_GET[\'catmax\'];<br>\n$workmax = $_GET[\'workmax\'];</p>\n<p>function savetodb()<br>\n{<br>\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;<br>\n    $sql = \"INSERT INTO `clicker_game_score` (`money`, `moneyup`, `msec`, `upcost`, `catcost`, `workercost`, `upown`, `catown`, `workerown`, `catadd`, `workadd`, `cboost`, `wboost`, `catmax`, `workmax`, `id`) VALUES ($money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax, \'\')\";<br>\n    if ($mysqli-&gt;query($sql) === TRUE) {<br>\n        echo \"Postep gry zostal zapisany\";<br>\n    } else {<br>\n        echo \"Error: \" . $sql . \"<br>\" . $mysqli-&gt;error;<br>\n    }<br>\n}</p>\n<p>function loadfromdb()<br>\n{<br>\n    global $mysqli, $money, $moneyup, $msec, $upcost, $catcost, $workercost, $upown, $catown, $workerown, $catadd, $workadd, $cboost, $wboost, $catmax, $workmax;<br>\n    $sql = \"SELECT * FROM `clicker_game_score`\";<br>\n    $result = $mysqli-&gt;query($sql);<br>\n    if ($result-&gt;num_rows &gt; 0) {<br>\n        while ($row = $result-&gt;fetch_assoc()) {<br>\n            $money = $row[\"money\"];<br>\n            $moneyup = $row[\"moneyup\"];<br>\n            $msec = $row[\"msec\"];<br>\n            $upcost = $row[\"upcost\"];<br>\n            $catcost = $row[\"catcost\"];<br>\n            $workercost = $row[\"workercost\"];<br>\n            $upown = $row[\"upown\"];<br>\n            $catown = $row[\"catown\"];<br>\n            $workerown = $row[\"workerown\"];<br>\n            $catadd = $row[\"catadd\"];<br>\n            $workadd = $row[\"workadd\"];<br>\n            $cboost = $row[\"cboost\"];<br>\n            $wboost = $row[\"wboost\"];<br>\n            $catmax = $row[\"catmax\"];<br>\n            $workmax = $row[\"workmax\"];<br>\n        }<br>\n    }<br>\n}<br>\n?&gt;</p>\n<p>\n    <script><br />\n        money = 0;<br />\n        moneyup = 1;<br />\n        msec = 0;<br />\n        upcost = 15;<br />\n        catcost = 25;<br />\n        workercost = 250;<br />\n        upown = 0;<br />\n        catown = 0;<br />\n        workerown = 0;<br />\n        catadd = 1;<br />\n        workadd = 15;<br />\n        cboost = 1;<br />\n        wboost = 1;<br />\n        catmax = 0;<br />\n        workmax = 0;</p>\n<p>        // save before exiting<br />\n        window.onbeforeunload = function() {<br />\n            if (confirm(\"You have closed the window, would you like to save?\")) {<br />\n                save();<br />\n            }<br />\n        };</p>\n<p>        function addcomma(x) {<br />\n            return x.toString().replace(/\\B(?=(\\d{3})+(?!\\d))/g, \",\");<br />\n        }</p>\n<p>        // updates all values<br />\n        function reloadall() {<br />\n            document.getElementById(\"click\").innerHTML =<br />\n                \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);<br />\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);<br />\n            document.getElementById(\"cat\").innerHTML =<br />\n                catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd) + \"/sec\";<br />\n            document.getElementById(\"worker\").innerHTML =<br />\n                workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd) + \"/sec\";<br />\n            document.getElementById(\"upgrade\").innerHTML =<br />\n                addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);<br />\n        }</p>\n<p>        // overwrites save file<br />\n        function save() {<br />\n            var xhr = new XMLHttpRequest();<br />\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?savetodb\", true);<br />\n            xhr.onreadystatechange = function() {<br />\n                if (xhr.readyState === 4 && xhr.status === 200) {<br />\n                    console.log(xhr.responseText);<br />\n                }<br />\n            };<br />\n            xhr.send();<br />\n        }</p>\n<p>        // loads save file<br />\n        function load() {<br />\n            var xhr = new XMLHttpRequest();<br />\n            xhr.open(\"GET\", \"http://clickergra.cba.pl/wp-content/code.php?loadfromdb\", true);<br />\n            xhr.onreadystatechange = function() {<br />\n                if (xhr.readyState === 4 && xhr.status === 200) {<br />\n                    var response = JSON.parse(xhr.responseText);<br />\n                    money = response.money;<br />\n                    moneyup = response.moneyup;<br />\n                    msec = response.msec;<br />\n                    upcost = response.upcost;<br />\n                    catcost = response.catcost;<br />\n                    workercost = response.workercost;<br />\n                    upown = response.upown;<br />\n                    catown = response.catown;<br />\n                    workerown = response.workerown;<br />\n                    catadd = response.catadd;<br />\n                    workadd = response.workadd;<br />\n                    cboost = response.cboost;<br />\n                    wboost = response.wboost;<br />\n                    catmax = response.catmax;<br />\n                    workmax = response.workmax;</p>\n<p>                    reloadall();<br />\n                }<br />\n            };<br />\n            xhr.send();<br />\n        }</p>\n<p>        // resets all values<br />\n        function reset() {<br />\n            if (confirm(\"Are you sure you want to reset?\")) {<br />\n                money = 0;<br />\n                moneyup = 1;<br />\n                msec = 0;<br />\n                upcost = 15;<br />\n                catcost = 25;<br />\n                workercost = 250;<br />\n                catown = 0;<br />\n                workerown = 0;<br />\n                upown = 0;<br />\n                catadd = 1;<br />\n                workadd = 15;<br />\n                reloadall();<br />\n            }<br />\n        }</p>\n<p>        // timer<br />\n        setInterval(function() {<br />\n            money += msec;<br />\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);<br />\n        }, 1000);</p>\n<p>        // what happens when button is clicked<br />\n        function clicked() {<br />\n            money += moneyup;<br />\n            document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);<br />\n        }</p>\n<p>        // upgrade function<br />\n        function upgrade(name) {<br />\n            if (name == \"clicker cat\") {<br />\n                if (money >= catcost && catown < 50) {\n                    if (catown <= 13) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 1;\n                    } else if (catown == 14) {\n                        msec += catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown <= 23) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 200;\n                    } else if (catown == 24) {\n                        msec += 200 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown <= 48) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 5000;\n                    } else if (catown == 49) {\n                        msec += 5000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    } else {\n                        msec += 15000 * catadd;\n                        catadd++;\n                        cboost = 15000;\n                    }\n                    catown += 1;\n                    money -= catcost;\n                    catcost = catcost * 2;\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd * cboost) + \"/sec\";\n                } else if (catown == 50) {\n                    document.getElementById(\"cat\").innerHTML =\n                        catown + \"-clicker cat: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"worker\") {\n                if (money >= workercost && workerown < 50) {\n                    if (workerown <= 13) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 1;\n                    } else if (workerown == 14) {\n                        msec += workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown <= 23) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 200;\n                    } else if (workerown == 24) {\n                        msec += 200 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown <= 48) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 5000;\n                    } else if (workerown == 49) {\n                        msec += 5000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    } else {\n                        msec += 15000 * workadd;\n                        workadd++;\n                        wboost = 15000;\n                    }\n                    workerown += 1;\n                    money -= workercost;\n                    workercost = workercost * 3;\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd * wboost) + \"/sec\";\n                } else if (workerown == 50) {\n                    document.getElementById(\"worker\").innerHTML =\n                        workerown + \"-worker: MAX | +15% click/sec\";\n                }\n            }\n\n            if (name == \"main upgrade\") {\n                if (money >= upcost && upown < 50) {\n                    upown += 1;\n                    money -= upcost;\n                    upcost = upcost * 2;\n                    moneyup = moneyup * 2;\n                    document.getElementById(\"click\").innerHTML =\n                        \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\n                } else if (upown == 50) {\n                    document.getElementById(\"upgrade\").innerHTML =\n                        addcomma(upown) + \"-main upgrade: MAX\";\n        