INSERT INTO `wp_clickersnippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES
(1, 'Make upload filenames lowercase', 'Makes sure that image and file uploads have lowercase filenames.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_filter( \'sanitize_file_name\', \'mb_strtolower\' );', 'sample, media', 'global', 10, 0, '2023-05-08 10:12:21'),
(2, 'Disable admin bar', 'Turns off the WordPress admin bar for everyone except administrators.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_action( \'wp\', function () {\n	if ( ! current_user_can( \'manage_options\' ) ) {\n		show_admin_bar( false );\n	}\n} );', 'sample, admin-bar', 'front-end', 10, 0, '2023-05-08 10:12:21'),
(3, 'Allow smilies', 'Allows smiley conversion in obscure places.\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', 'add_filter( \'widget_text\', \'convert_smilies\' );\nadd_filter( \'the_title\', \'convert_smilies\' );\nadd_filter( \'wp_title\', \'convert_smilies\' );\nadd_filter( \'get_bloginfo\', \'convert_smilies\' );', 'sample', 'global', 10, 0, '2023-05-08 10:12:21'),
(4, 'Current year', 'Shortcode for inserting the current year into a post or page..\n\nThis is a sample snippet. Feel free to use it, edit it, or remove it.', '<?php echo date( \'Y\' ); ?>', 'sample, dates', 'content', 10, 0, '2023-05-08 10:12:21'),
(5, 'dbcon', '', '$hostname=\"localhost\";\r\n$username=\"clicker\";\r\n$password=\"NFyuDpA1DW\";\r\n$database=\"dedmenxd\";\r\n\r\n$mysqli=mysqli_connect($hostname,$username,$password,$database);\r\nif ($mysqli -> connect_errno) {\r\n    echo \"Failed to connect to MySQL: \" . $mysqli -> connect_error;\r\n    exit();\r\n}\r\n$money = $_GET[\'money\'];\r\n$moneyup = $_GET[\'moneyup\'];\r\n$msec = $_GET[\'msec\'];\r\n$upcost = $_GET[\'upcost\'];\r\n$catcost = $_GET[\'catcost\'];\r\n$workercost = $_GET[\'workercost\'];\r\n$upown = $_GET[\'upown\'];\r\n$catown = $_GET[\'catown\'];\r\n$workerown = $_GET[\'workerown\'];\r\n$catadd = $_GET[\'catadd\'];\r\n$workadd = $_GET[\'workadd\'];\r\n$cboost = $_GET[\'cboost\'];\r\n$wboost = $_GET[\'wboost\'];\r\n$catmax = $_GET[\'catmax\'];\r\n$workmax = $_GET[\'workmax\'];\r\n\r\nfunction savetodb(){\r\n    $sql = \"INSERT INTO `clicker_game_score` (`money`, `moneyup`, `msec`, `upcost`, `catcost`, `workercost`, `upown`, `catown`, `workerown`, `catadd`, `workadd`, `cboost`, `wboost`, `catmax`, `workmax`,`id` ) VALUES ($money,$moneyup,$msec,$upcost,$catcost,$workercost,$upown,$catown,$workerown,$catadd,$workadd,$cboost,$wboost,$catmax,$workmax,\\\'\\\')\";\r\n    if ($mysqli->query($sql) === TRUE) {\r\n        echo \"Postep gry zostal zapisany\";\r\n      } else {\r\n        echo \"Error: \" . $sql . \"<br>\" . $mysqli->error;\r\n      }\r\n}\r\nfunction loadfromdb(){\r\n    $sql = \"SELECT * FROM `clicker_game_score`\";\r\n    $result = $mysqli->query($sql);\r\nif ($result->num_rows > 0) {\r\n    while ($row = $result->fetch_assoc()) {\r\n        \r\n        $money = $row[\"money\"];\r\n        $moneyup = $row[\"moneyup\"];\r\n        $msec = $row[\"msec\"];\r\n        $upcost = $row[\"upcost\"];\r\n        $catcost = $row[\"catcost\"];\r\n        $workercost = $row[\"workercost\"];\r\n        $upown = $row[\"upown\"];\r\n        $catown = $row[\"catown\"];\r\n        $workerown = $row[\"workerown\"];\r\n        $catadd = $row[\"catadd\"];\r\n        $workadd = $row[\"workadd\"];\r\n        $cboost = $row[\"cboost\"];\r\n        $wboost = $row[\"wboost\"];\r\n        $catmax = $row[\"catmax\"];\r\n        $workmax = $row[\"workmax\"];\r\n    }\r\n}\r\n}\r\n?>\r\n\r\n\r\n<!DOCTYPE html>\r\n<script>\r\nmoney = 0;\r\nmoneyup = 1;\r\nmsec = 0;\r\nupcost = 15;\r\ncatcost = 25;\r\nworkercost = 250;\r\nupown = 0;\r\ncatown = 0;\r\nworkerown = 0;\r\ncatadd = 1;\r\nworkadd = 15;\r\ncboost = 1;\r\nwboost = 1;\r\ncatmax = 0;\r\nworkmax = 0;\r\n\r\n//save before exiting\r\nfunction closingCode() {\r\n  if (confirm(\"You have closed the window, would you like to save?\") === true) {\r\n    save();\r\n    return null;\r\n  }\r\n}\r\n\r\nfunction addcomma(x) {\r\n  return x.toString().replace(/\\B(?=(\\d{3})+(?!\\d))/g, \",\")\r\n}\r\n//updates all values\r\nfunction reloadall() {\r\n  document.getElementById(\"click\").innerHTML =\r\n    \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\r\n  document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n  document.getElementById(\"cat\").innerHTML =\r\n    catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd) + \"/sec\";\r\n  document.getElementById(\"worker\").innerHTML =\r\n    workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd) + \"/sec\";\r\n  document.getElementById(\"upgrade\").innerHTML =\r\n    addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\r\n}\r\n//overwrites save file\r\nfunction save() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\"GET\", \"code.php?action=savetodb\", true);\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            console.log(xhr.responseText);\r\n        }\r\n    };\r\n    xhr.send();\r\n}\r\n\r\n//loads save file\r\nfunction load() {\r\n    var xhr = new XMLHttpRequest();\r\n    xhr.open(\"GET\", action=loadfromdb, true);\r\n    xhr.onreadystatechange = function() {\r\n        if (xhr.readyState === 4 && xhr.status === 200) {\r\n            var response = JSON.parse(xhr.responseText);\r\n            money = response.money;\r\n            moneyup = response.moneyup;\r\n            msec = response.msec;\r\n            upcost = response.upcost;\r\n            catcost = response.catcost;\r\n            workercost = response.workercost;\r\n            upown = response.upown;\r\n            catown = response.catown;\r\n            workerown = response.workerown;\r\n            catadd = response.catadd;\r\n            workadd = response.workadd;\r\n            cboost = response.cboost;\r\n            wboost = response.wboost;\r\n            catmax = response.catmax;\r\n            workmax = response.workmax;\r\n            \r\n            reloadall();\r\n        }\r\n    };\r\n    xhr.send();\r\n}\r\n\r\n//resets all values\r\nfunction reset() {\r\n  if (confirm(\"Are you sure you want to reset?\") === true) {\r\n    money = 0;\r\n    moneyup = 1;\r\n    msec = 0;\r\n    upcost = 15;\r\n    catcost = 25;\r\n    workercost = 250;\r\n    catown = 0;\r\n    workerown = 0;\r\n    upown = 0;\r\n    catadd = 1;\r\n    workadd = 15;\r\n    reloadall();\r\n  }\r\n}\r\n//timer\r\nfunction myTimer() {\r\n    money += msec;\r\n  document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n}\r\nsetInterval(myTimer, 1000);\r\n\r\n//what happens when button is clicked\r\nfunction clicked() {\r\n  money += moneyup;\r\n  document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n}\r\n//upgrade function\r\nfunction upgrade(name) {\r\n  if (name == \"clicker cat\") {\r\n    if (money >= catcost && catown < 50) {\r\n      \r\n      if (catown <= 13) {\r\n        msec += catadd;\r\n        catadd++;\r\n        cboost = 1;\r\n      } else if (catown == 14) {\r\n        msec += catadd;\r\n        catadd++;\r\n        cboost = 200;\r\n      } else if (catown <= 23) {\r\n        msec += 200 * catadd;\r\n        catadd++;\r\n        cboost = 200;\r\n      } else if (catown == 24) {\r\n        msec += 200 * catadd;\r\n        catadd++;\r\n        cboost = 5000;\r\n      } else if (catown <= 48) {\r\n        msec += 5000 * catadd;\r\n        catadd++;\r\n        cboost = 5000;\r\n      } else if (catown == 49) {\r\n        msec += 5000 * catadd;\r\n        catadd++;\r\n        cboost = 15000;\r\n      } else {\r\n        msec += 15000 * catadd;\r\n        catadd++;\r\n        cboost = 15000;\r\n      }\r\n      catown += 1;\r\n      money -= catcost;\r\n      catcost = catcost * 2;\r\n      document.getElementById(\"cat\").innerHTML =\r\n        catown + \"-clicker cat: \" + addcomma(catcost) + \" | +\" + addcomma(catadd * cboost) + \"/sec\";\r\n    } else if (catown == 50) {\r\n      document.getElementById(\"cat\").innerHTML =\r\n        catown + \"-clicker cat: MAX | +15% click/sec\";\r\n    }\r\n  }\r\n\r\n  if (name == \"worker\") {\r\n    if (money >= workercost && workerown < 50) {\r\n      \r\n      if (workerown <= 13) {\r\n        msec += workadd;\r\n        workadd++;\r\n        wboost = 1;\r\n      } else if (workerown == 14) {\r\n        msec += workadd;\r\n        workadd++;\r\n        wboost = 200;\r\n      } else if (workerown <= 23) {\r\n        msec += 200 * workadd;\r\n        workadd++;\r\n        wboost = 200;\r\n      } else if (workerown == 24) {\r\n        msec += 200 * workadd;\r\n        workadd++;\r\n        wboost = 5000;\r\n      } else if (workerown <= 48) {\r\n        msec += 5000 * workadd;\r\n        workadd++;\r\n        wboost = 5000;\r\n      } else if (workerown == 49) {\r\n        msec += 5000 * workadd;\r\n        workadd++;\r\n        wboost = 15000;\r\n      } else {\r\n        msec += 15000 * workadd;\r\n        workadd++;\r\n        wboost = 15000;\r\n      }\r\n      workerown += 1;\r\n      money -= workercost;\r\n      workercost = workercost * 3;\r\n      document.getElementById(\"worker\").innerHTML = \r\n        workerown + \"-worker: \" + addcomma(workercost) + \" | +\" + addcomma(workadd * wboost) + \"/sec\";\r\n    } else if (workerown == 50) {\r\n      document.getElementById(\"worker\").innerHTML =\r\n        workerown + \"-worker: MAX | +35% click/sec\";\r\n    }\r\n  }\r\n\r\n  if (name == \"upgrade\") {\r\n    if (money >= upcost) {\r\n      moneyup += upcost / 15;\r\n      money -= upcost;\r\n      upown += 1;\r\n      upcost = upcost * 5;\r\n      document.getElementById(\"upgrade\").innerHTML =\r\n        addcomma(upown) + \"-main upgrade: \" + addcomma(upcost);\r\n      if (catown == 50) {\r\n        msec -= catmax;\r\n        catmax = Math.floor(moneyup * 0.15);\r\n        msec += catmax;\r\n      }\r\n      if (workerown == 50) {\r\n        msec -= workmax;\r\n        workmax = Math.floor(moneyup * 0.35);\r\n        msec += workmax;\r\n      }\r\n    }\r\n  }\r\n\r\n  document.getElementById(\"click\").innerHTML =\r\n    \"Points/click: \" + addcomma(moneyup) + \" | Points/sec: \" + addcomma(msec);\r\n  document.getElementById(\"total\").innerHTML = \"Points: \" + addcomma(money);\r\n}\r\n     </script>', '', 'single-use', 1, 0, '2023-05-24 18:25:51');
